11384=>["Value"=>11384,"TextKey"=>"图鉴描述10501","TextValue"=>"The King of the Hill Kingdom. A total sweet tooth. He's loved by the people for being happy-go-lucky, amiable and charismatic."],
11385=>["Value"=>11385,"TextKey"=>"图鉴描述10502","TextValue"=>"Universellement connu tel l'un des plus grands sorciers de l'époque. Doué d'un génie fertile, de bienveillance, d'amabilité et de perspicacité. De tous les déguisements, il se transformait habituellement en lapin, et seules quelques personnes ont vu son vrai visage derrière la magie."],
11386=>["Value"=>11386,"TextKey"=>"图鉴描述10503","TextValue"=>"Le légendaire conteur et compositeur de musique de la tribu. Alors qu'il parcourait les terres et les mers, personne ne le voyait jamais. Avec sa voix profonde et son esprit, de nombreux éloges ont été chantés. "],
11387=>["Value"=>11387,"TextKey"=>"图鉴描述10504","TextValue"=>"Pur et peng. Pleine de curiosité pour le monde extérieur, il aime jouer du tambour quand il se sent expressif."],
11388=>["Value"=>11388,"TextKey"=>"图鉴描述10505","TextValue"=>"Le roi de tous les lions, et marche tel un humain. Il a un jour perdu sa merveilleuse terre natale aux côtés des membres de sa tribu, mais grâce à sa force exceptionnelle, son témoignage et sa bravoure, un vrai leader finira par la reprendra."],
11389=>["Value"=>11389,"TextKey"=>"图鉴描述10506","TextValue"=>"Walked out of a heartbreaking past, she becomes stronger and more optimistic. She also learnt a magic that can makes visions in match flames come true."],
11390=>["Value"=>11390,"TextKey"=>"图鉴描述10507","TextValue"=>"He's wee stingy and naughty. Was once cursed by the Witch because of his prank. With a pumpkin head, he becomes more kind, often holding a lantern to light passers-by in the dark."],
