12681=>["Value"=>12681,"TextKey"=>"新手引导说明1012","TextValue"=>"<line-height=130%>La <color=#38aec0>Patrie</color> a été débloquée ! Allez voir ça de plus près !"],
12682=>["Value"=>12682,"TextKey"=>"新手引导说明2000","TextValue"=>"<line-height=130%>Gentille personne, aidez-moi s'il vous plaît !"],
12683=>["Value"=>12683,"TextKey"=>"新手引导说明2001","TextValue"=>"<line-height=130%>Je suis piégé dans ces <color=#38c0a5>Totems</color> !"],
12684=>["Value"=>12684,"TextKey"=>"新手引导说明2002","TextValue"=>"Rassemblez 3 <color=#38c0a5>Totems</color> du même type pour déclencher une <color=#f58c26>Fusion</color> et ainsi lever la malédiction."],
12685=>["Value"=>12685,"TextKey"=>"新手引导说明2010","TextValue"=>"<line-height=130%>Ah ! Je ne vois aucun totem ici !"],
12686=>["Value"=>12686,"TextKey"=>"新手引导说明2011","TextValue"=>"<line-height=130%>Regardez ! C'est le <color=#f58c26>Code de la Création</color>. Vous le trouverez à différents niveaux. Voyons ce qui est écrit à l'intérieur."],
12687=>["Value"=>12687,"TextKey"=>"新手引导说明2012","TextValue"=>"<line-height=130%>Touchez pour obtenir des conseils utiles sur le jeu. Essayez !"],
12688=>["Value"=>12688,"TextKey"=>"新手引导说明2020","TextValue"=>"<line-height=130%>Pour terminer un niveau, vous devez obtenir l'<color=#f58c26>objet désigné</color>."],
12689=>["Value"=>12689,"TextKey"=>"新手引导说明2022","TextValue"=>"<line-height=130%>L'<color=#f58c26>Oobjectif de niveau</color> vous indiquera ce que vous devez obtenir. Commencez à fusionner et gagnez !"],
12690=>["Value"=>12690,"TextKey"=>"新手引导说明2030","TextValue"=>"<line-height=120%>Waouh, une <color=#ef933d>Gravure d'Embla jeune</color> ! Leurs pouvoirs se sont aussi évanouis ! Nous devons réveiller <color=#f58c26>Embla</color> en fusionnant ces gravures."],
12691=>["Value"=>12691,"TextKey"=>"新手引导说明2031","TextValue"=>"Si un niveau comporte ces gravures, vous pouvez généralement terminer le niveau en les fusionnant."],
12692=>["Value"=>12692,"TextKey"=>"新手引导说明2032","TextValue"=>"<line-height=130%>Ces terres ont perdu leur connexion avec la Déesse et sont tombées dans un profond sommeil."],
12693=>["Value"=>12693,"TextKey"=>"新手引导说明2033","TextValue"=>"<line-height=130%>Il est impossible de déplacer un objet sur des <color=#38aec0>Terres dormantes</color>."],
12694=>["Value"=>12694,"TextKey"=>"新手引导说明2034","TextValue"=>"<line-height=130%>Fusionnez n'importe quelle <color=#38c0a5>Fleur d'esprit</color> pour réveiller la terre."],
12695=>["Value"=>12695,"TextKey"=>"新手引导说明2035","TextValue"=>"<line-height=130%>Lorsque vous gagnez, la <color=#f58c26>Déesse Embla</color> réveillera toutes les terres !"],
12696=>["Value"=>12696,"TextKey"=>"新手引导说明2040","TextValue"=>"<line-height=130%>Regardez ! C'est un <color=#38c0a5>Totem</color>."],
12697=>["Value"=>12697,"TextKey"=>"新手引导说明2041","TextValue"=>"Dépêchez-vous de fusionner <color=#38c0a5>Trois totems</color> pour sauver le membre de tribus piégé à l'intérieur !"],
12698=>["Value"=>12698,"TextKey"=>"新手引导说明2050","TextValue"=>"Comme nous venons de le dire, vous pouvez toucher un <color=#38c0a5>Orbe runique</color> pour réveiller une terre."],
12699=>["Value"=>12699,"TextKey"=>"新手引导说明2051","TextValue"=>"<line-height=130%>Bien évidemment, vous pouvez aussi les fusionner pour en obtenir de plus avancés !"],
12700=>["Value"=>12700,"TextKey"=>"新手引导说明2060","TextValue"=>"Vous pouvez fusionner les objets qui se trouvent sur les <color=#38aec0>Terres dormantes</color> avec ceux des terres normales pour réveiller automatiquement ceux des terres dormantes."],
12701=>["Value"=>12701,"TextKey"=>"新手引导说明2070","TextValue"=>"Touchez un <color=#38c0a5>Amas de totems</color> pour obtenir un <color=#38c0a5>Totem</color>."],
12702=>["Value"=>12702,"TextKey"=>"新手引导说明2080","TextValue"=>"Certaines <color=#38aec0>Super terres dormantes</color> ne peuvent être réveillées par des <color=#f58c26>Points de guérison</color>, mais uniquement en fusionnant leurs objets avec ceux des terres normales."],
12703=>["Value"=>12703,"TextKey"=>"新手引导说明2090","TextValue"=>"<line-height=130%>Dorénavant, les niveaux comportent des <color=#f58c26>Tâches</color>."],
12704=>["Value"=>12704,"TextKey"=>"新手引导说明2091","TextValue"=>"<line-height=130%>Vous pouvez consulter le <color=#38c0a5>Soleil des missions</color> pour découvrir les différentes missions et leurs récompenses."],
12705=>["Value"=>12705,"TextKey"=>"新手引导说明2093","TextValue"=>"<line-height=130%>Verrouille ou de déverrouille la <color=#f58c26>Fonction glisser l'écran</color>."],
12706=>["Value"=>12706,"TextKey"=>"新手引导说明2100","TextValue"=>"Certains objets ne peuvent pas être fusionnés directement. Touchez le <color=#ef933d>Tas de roches cunéiformes</color> pour le fragmenter en <color=#ef933d>Roches cunéiformes</color> puis le fusionner. "],
12707=>["Value"=>12707,"TextKey"=>"新手引导说明2110","TextValue"=>"<line-height=130%>Vous devez vérifier les <color=#f58c26>Objectifs de niveau</color>."],
12708=>["Value"=>12708,"TextKey"=>"新手引导说明2130","TextValue"=>"<line-height=130%>Vous pouvez obtenir des <color=#ef933d>Pousses de buisson</color> dans des <color=#38c0a5>Ossements de dragons</color>."],
12709=>["Value"=>12709,"TextKey"=>"新手引导说明2140","TextValue"=>"Cette <color=#ef933d>Bombe de réveil</color> est énorme. Si vous réveillez le terrain à côté d'elle, elle se réveillera automatiquement, et réveillera les cases qui l'entourent directement."],
12710=>["Value"=>12710,"TextKey"=>"新手引导说明2150","TextValue"=>"Les Membres de tribus peuvent récupérer pour vous des <color=#38c0a5>Minerais sauvages</color> provenant de <color=#38c0a5>Vignes</color> de niveau supérieur."],
12711=>["Value"=>12711,"TextKey"=>"新手引导说明2160","TextValue"=>"Voici une <color=#ef933d>Tombe fracassée</color>. Si vous les négligez ou les fusionnez, elles se transformeront en terrifiants <color=#df66a8>Zombies</color>. Terrassez-les pour obtenir des <color=#38c0a5>Lucioles</color>, nécessaires pour passer ce niveau."],
12712=>["Value"=>12712,"TextKey"=>"新手引导说明2170","TextValue"=>"Un <color=#ef933d>Nid d'oiseau abandonné</color> génère constamment des zombies, même lorsqu'il est endormi. Le toucher génère un zombie immédiatement ! Tuez les zombies et vous obtiendrez des <color=#38c0a5>Minerais sauvages</color>."],
12713=>["Value"=>12713,"TextKey"=>"新手引导说明2180","TextValue"=>"Voici un <color=#38c0a5>Portail runique druidique</color>, nous sommes vraiment chanceux ! Fusionnez-les pour invoquer un <color=#38c0a5>Membre de tribus</color> de la Patrie pour vous épauler."],
12714=>["Value"=>12714,"TextKey"=>"新手引导说明2190","TextValue"=>"La rémanence de l'Arbre sacré de la Création. Produit automatiquement des <color=#38c0a5>Orbes runiques sauvages</color>. Plus le niveau est élevé, plus le pouvoir de guérison est puissant."],
12715=>["Value"=>12715,"TextKey"=>"新手引导说明2200","TextValue"=>" Des <color=#ef933d>Nuages</color> vont continuer à apparaître à cet endroit. Touchez-les pour les faire pleuvoir. Des <color=#38c0a5>Flaques d'eau</color> et des <color=#38c0a5>Fleurs d'esprit</color> apparaîtront sur les terrains vides en dessous."],
12716=>["Value"=>12716,"TextKey"=>"新手引导说明2210","TextValue"=>"<line-height=130%>Étrange... où sont passées les <color=#ef933d>Gravures d'Embla jeune</color> ?"],
12717=>["Value"=>12717,"TextKey"=>"新手引导说明2211","TextValue"=>"<line-height=130%>Oh, oui, si vous effectuez vos <color=#f58c26>missions</color>, elles apparaîtront !"],
12718=>["Value"=>12718,"TextKey"=>"新手引导说明2220","TextValue"=>"Voici une <color=#ef933d>Statue de démon</color>. C'est une œuvre hideuse ! Ordonnez à vos hommes de l'anéantir pour obtenir une <color=#ef933d>Gravure d'Embla jeune</color>."],
12719=>["Value"=>12719,"TextKey"=>"新手引导说明2230","TextValue"=>"<line-height=130%>Un nouveau Camp a ouvert ses portes ! Allez le découvrir sur la Carte du monde !"],
12720=>["Value"=>12720,"TextKey"=>"新手引导说明2240","TextValue"=>"<line-height=130%>Je suis à nouveau libre ! Merci beaucoup ! "],
12721=>["Value"=>12721,"TextKey"=>"新手引导说明2241","TextValue"=>"<line-height=130%>Les gens de notre tribu sont piégés à l'intérieur de ces <color=#38c0a5>Totems</color>."],
12722=>["Value"=>12722,"TextKey"=>"新手引导说明2242","TextValue"=>"<line-height=130%>La tribu a besoin de votre aide pour retrouver d'autres membres de tribus ici, ainsi qu'au pays."],
12723=>["Value"=>12723,"TextKey"=>"新手引导说明2243","TextValue"=>"<line-height=130%>Allez les trouver dans le niveau suivant !"],
12724=>["Value"=>12724,"TextKey"=>"新手引导说明2250","TextValue"=>"Vous pouvez <color=#f58c26>tapoter</color> deux fois sur certains objets pour faire venir quelqu'un pour les récolter."],
12725=>["Value"=>12725,"TextKey"=>"新手引导说明2251","TextValue"=>"<line-height=130%>Vous pouvez utiliser ou fusionner les objets que vous avez rassemblés."],
12726=>["Value"=>12726,"TextKey"=>"新手引导说明2252","TextValue"=>"<line-height=130%>Récoltez une <color=#38c0a5>Fleur d'esprit</color> pour obtenir un <color=#38c0a5>Orbe runique</color>."],
12727=>["Value"=>12727,"TextKey"=>"新手引导说明2253","TextValue"=>"<color=#f58c26>Touchez l'orbe</color> pour réveiller les <color=#38aec0>Terres dormantes</color>."],
12728=>["Value"=>12728,"TextKey"=>"新手引导说明2261","TextValue"=>"<line-height=130%>Dorénavant, vous pouvez choisir des récompenses à la fin de chaque niveau."],
12729=>["Value"=>12729,"TextKey"=>"新手引导说明2262","TextValue"=>"<line-height=130%>Les récompenses sont généralement de l'<color=#38c0a5>Or</color> ou d'autres ressources utiles. Parfois même un totem !"],
12730=>["Value"=>12730,"TextKey"=>"新手引导说明2263","TextValue"=>"<line-height=130%>Vos récompenses seront placées dans des <color=#f58c26>Bulles</color> et envoyées à votre domicile."],
12731=>["Value"=>12731,"TextKey"=>"新手引导说明3000","TextValue"=>"<line-height=130%>Voici notre <color=#f58c26>Patrie</color>."],
12732=>["Value"=>12732,"TextKey"=>"新手引导说明3001","TextValue"=>"<line-height=130%>Enfin c'était là où elle se trouvait, avant que la <color=#f58c26>Grande inondation</color> ne détruise notre vie paisible, laissant derrière elle un épais brouillard recouvrant la terre."],
12733=>["Value"=>12733,"TextKey"=>"新手引导说明3002","TextValue"=>"<line-height=105%>Fusionnez des objets avec ceux des terres dormantes pour réveiller directement les terres ! Essayez de fusionner pour sauver plus de membres de tribus ! Plus votre population est importante, plus le brouillard peut être dissipé et plus vite vous pourrez reconstruire notre patrie."],
12734=>["Value"=>12734,"TextKey"=>"新手引导说明3005","TextValue"=>"<line-height=130%>Vous ne pouvez débloquer qu'un seul <color=#38c0a5>Coffre au trésor du temps</color> à la fois. Attendez la fin du compte à rebours pour les obtenir, ou dépensez des Rubis pour obtenir immédiatement n'importe quel <color=#38c0a5>Coffre au trésor du temps</color>."],
12735=>["Value"=>12735,"TextKey"=>"新手引导说明3006","TextValue"=>"<line-height=130%>Les récompenses de niveau sont arrivées ! Ouvrez les bulles pour les découvrir !"],
12736=>["Value"=>12736,"TextKey"=>"新手引导说明3010","TextValue"=>"<line-height=130%>Les <color=#38c0a5>Maisons longues</color> sont des endroits où les ouvriers peuvent se reposer. Ils ressortent après un certain temps."],
12737=>["Value"=>12737,"TextKey"=>"新手引导说明3011","TextValue"=>"<line-height=130%>Les <color=#38c0a5>Maisons longues</color> peuvent être fusionnées pour former des maisons de niveau supérieur. Plus leur niveau est élevé, plus le temps nécessaire aux membres de tribus pour se reposer à l'intérieur est court."],
12738=>["Value"=>12738,"TextKey"=>"新手引导说明3016","TextValue"=>"<line-height=130%>Dépensez des <color=#38c0a5>Rubis</color> pour les réveiller immédiatement."],
12739=>["Value"=>12739,"TextKey"=>"新手引导说明3030","TextValue"=>"En accomplissant plus de missions de la Patrie, vous obtiendrez plus d'<color=#38c0a5>Héritage oublié</color>. Touchez-les pour obtenir des récompenses spéciales !"],
12740=>["Value"=>12740,"TextKey"=>"新手引导说明3040","TextValue"=>"<line-height=130%>Voici une minuscule pièce <color=#38c0a5>d'or</color>."],
12741=>["Value"=>12741,"TextKey"=>"新手引导说明3041","TextValue"=>"<line-height=120%>Vous pouvez les toucher pour obtenir des pièces <color=#38c0a5>d'or</color> ou les fusionner pour obtenir des pépites d'or plus avancées."],
12742=>["Value"=>12742,"TextKey"=>"新手引导说明3042","TextValue"=>"<line-height=130%>Vous pouvez dépenser vos pièces <color=#38c0a5>d'or</color> au <color=#f58c26>Magasin</color>."],
12743=>["Value"=>12743,"TextKey"=>"新手引导说明3050","TextValue"=>"<line-height=130%>Vous disposez de trop de pièces d'or ? Vous pouvez vous rendre au magasin et acheter de très belles choses !"],
12744=>["Value"=>12744,"TextKey"=>"新手引导说明3060","TextValue"=>"<line-height=130%>Tous les <color=#df66a8>Membres de tribus</color> sont trop fatigués. Ils ont besoin de faire une pause pour reprendre des forces."],
12745=>["Value"=>12745,"TextKey"=>"新手引导说明3061","TextValue"=>"<line-height=130%>Il est temps de terminer plus de niveaux et de sauver plus de personnes !"],
12746=>["Value"=>12746,"TextKey"=>"新手引导说明3062","TextValue"=>"<line-height=120%>Plus vous avez de membres de tribus, plus la quantité de ressources qu'ils peuvent rassembler pour vous avant de se coucher est élevée."],
12747=>["Value"=>12747,"TextKey"=>"新手引导说明3063","TextValue"=>"<line-height=130%>Terminez les niveaux pour sauver davantage de membres de tribus."],
12748=>["Value"=>12748,"TextKey"=>"新手引导说明3064","TextValue"=>"<line-height=130%>Et ramenez-les à votre domicile !"],
12749=>["Value"=>12749,"TextKey"=>"新手引导说明3065","TextValue"=>"<line-height=130%>Regardez ! Vous pouvez vous rendre au Campement en touchant la <color=#f58c26>Carte du monde</color>."],
12750=>["Value"=>12750,"TextKey"=>"新手引导说明3070","TextValue"=>"<line-height=130%>Il n'y a plus d'espace pour mettre quoi que ce soit : le sol est complètement recouvert !"],
12751=>["Value"=>12751,"TextKey"=>"新手引导说明3071","TextValue"=>"<line-height=130%>Sélectionnez un objet, puis choisissez si vous voulez le vendre ou le jeter. "],
12752=>["Value"=>12752,"TextKey"=>"新手引导说明3080","TextValue"=>"Voici un <color=#38c0a5>Héritage extraterrestre</color>, c'est extrêmement rare ! Touchez-le pour recevoir des <color=#38c0a5>Rubis</color> ! Ou vous pouvez les fusionner pour obtenir des héritages plus avancés !"],
12753=>["Value"=>12753,"TextKey"=>"新手引导说明3090","TextValue"=>"<line-height=130%>Voici un morceau de <color=#38c0a5>Minerai sauvage</color>."],
12754=>["Value"=>12754,"TextKey"=>"新手引导说明3091","TextValue"=>"<line-height=130%>Vous pouvez les toucher pour récupérer des <color=#38c0a5>Minerais sauvages</color> ou les fusionner pour en obtenir de plus avancés !"],
12755=>["Value"=>12755,"TextKey"=>"新手引导说明3092","TextValue"=>"<line-height=130%>Vous pouvez dépenser les <color=#38c0a5>Minerais sauvages</color> que vous avez récupérés au <color=#f58c26>Magasin</color>."],
12756=>["Value"=>12756,"TextKey"=>"新手引导说明3100","TextValue"=>"<line-height=130%>Si votre stockage de <color=#38c0a5>Minerai sauvage</color> est trop chargé, vous pouvez également les dépenser dans le magasin."],
12757=>["Value"=>12757,"TextKey"=>"新手引导说明3110","TextValue"=>"Ce <color=#38c0a5>Barrage routier</color> ici me dérange beaucoup ! Mais impossible de le déplacer directement. Ordonnez à vos <color=#df66a8>Membres de tribus</color> de l'attaquer pour le scinder en plus petits barrages."],
12758=>["Value"=>12758,"TextKey"=>"新手引导说明3120","TextValue"=>"Les <color=#38c0a5>Barbettes</color> contaminent les terres même lorsqu'elles sont situées sur des terres dormantes. La <color=#f58c26>Barre de progression</color> indique l'intervalle entre chaque tir. Vous ne pouvez attaquer qu'une barbette réveillée."],
12759=>["Value"=>12759,"TextKey"=>"新手引导说明3130","TextValue"=>"Voici l'<color=#f58c26>Autel du héros</color>. Il permet aux héros de passer du <color=#f58c26>Mode repos</color> au <color=#f58c26>Mode patrouille</color>."],
12760=>["Value"=>12760,"TextKey"=>"新手引导说明3131","TextValue"=>"Avec un héros autour, des surprises supplémentaires vous attendent pour toute <color=#f58c26>fusion de 4 objets</color> !"],
12761=>["Value"=>12761,"TextKey"=>"新手引导说明3132","TextValue"=>"S'ils sont au repos, vous pouvez dépenser des <color=#38c0a5>Rubis</color> pour les réveiller immédiatement."],
12762=>["Value"=>12762,"TextKey"=>"新手引导说明3133","TextValue"=>"Vous pouvez cliquer ici pour consulter des informations sur le héros."],
12763=>["Value"=>12763,"TextKey"=>"新手引导说明3142","TextValue"=>"<line-height=130%>Les héros possèdent des capacités uniques en tant que puissantes unités de la tribu."],
12764=>["Value"=>12764,"TextKey"=>"新手引导说明3144","TextValue"=>"<line-height=130%>Vous pouvez consulter la description des capacités d'un héros ici, sur le <color=#f58c26> panneau des capacités du héros</color>."],
12765=>["Value"=>12765,"TextKey"=>"新手引导说明3145","TextValue"=>"<line-height=130%>Vous pouvez faire évoluer vos héros en soumettant des <color=#f58c26>Quêtes</color> terminées."],
12766=>["Value"=>12766,"TextKey"=>"新手引导说明3147","TextValue"=>"Terminez toutes les quêtes pour faire évoluer votre héros !"],
12767=>["Value"=>12767,"TextKey"=>"新手引导说明3150","TextValue"=>"<line-height=130%>Bien joué ! D'autres membres de tribus ont été libérés du sceau du sorcier !"],
12768=>["Value"=>12768,"TextKey"=>"新手引导说明3151","TextValue"=>"Si votre tribu compte plus de membres, vous serez en mesure de dissiper plus de <color=#f58c26>Brouillard</color> !"],
12769=>["Value"=>12769,"TextKey"=>"新手引导说明3152","TextValue"=>"<line-height=130%>Le brouillard dans chaque zone nécessite un certain niveau de Pouvoir tribal pour être dissipé."],
12770=>["Value"=>12770,"TextKey"=>"新手引导说明3153","TextValue"=>"<line-height=130%>Nous pouvons à présent dissiper le brouillard dans cette région !"],
12771=>["Value"=>12771,"TextKey"=>"新手引导说明3161","TextValue"=>"Impossible de dissiper ce brouillard pour l'instant."],
12772=>["Value"=>12772,"TextKey"=>"新手引导说明3162","TextValue"=>"<line-height=130%>Votre <color=#f58c26>Pouvoir tribal</color> n'est pas assez élevé. Vous pouvez vous procurer d'autres totems dans le magasin."],
12773=>["Value"=>12773,"TextKey"=>"新手引导说明3165","TextValue"=>"<line-height=130%>Dépensez des pièces d'or pour acheter des totems !"],
12774=>["Value"=>12774,"TextKey"=>"新手引导说明3166","TextValue"=>"<line-height=130%>Le prix des totems augmentera après chaque achat. Allez trouver plus de pièces d'or !"],
12775=>["Value"=>12775,"TextKey"=>"新手引导说明2270","TextValue"=>"<line-height=130%>Ce niveau comporte une <color=#f58c26>Limite de temps</color>. Vous devez terminer l'épreuve dans le temps imparti, ou vous perdrez."],
12776=>["Value"=>12776,"TextKey"=>"新手引导说明2271","TextValue"=>"<line-height=130%>Vous pouvez consulter le temps restant ici."],
12777=>["Value"=>12777,"TextKey"=>"新手引导说明2273","TextValue"=>"<line-height=130%>Au fur et à mesure que le temps restant diminue, la couleur des chiffres passe du <color=#46bb83>Vert</color> au <color=#eca852>Jaune</color> et finalement au <color=#e04030>Rouge</color>."],
12778=>["Value"=>12778,"TextKey"=>"新手引导说明2274","TextValue"=>"<line-height=130%>Afin de terminer le niveau plus rapidement, allez voir ce qu'il y a au Magasin."],
12779=>["Value"=>12779,"TextKey"=>"新手引导说明2277","TextValue"=>"<line-height=130%>Vous pouvez dépenser des <color=#38c0a5>Rubis</color> pour acheter des objets clés directement dans le Magasin."],
12780=>["Value"=>12780,"TextKey"=>"新手引导说明2281","TextValue"=>"<line-height=130%>Ce type de niveaux vous permet d'obtenir un <color=#38c0a5>Membre de tribus</color> en guise de récompense. Vous pouvez dépenser des <color=#38c0a5>Rubis</color> pour doubler vos récompenses."],
12781=>["Value"=>12781,"TextKey"=>"新手引导说明2290","TextValue"=>"<line-height=130%>Bienvenue pour une nouvelle Épreuve divine ! Une récompense vous sera également offerte après avoir relevé le défi."],
12782=>["Value"=>12782,"TextKey"=>"新手引导说明2291","TextValue"=>"<line-height=130%>Vous pouvez effectuer une épreuve <color=#f58c26>trois fois</color>, mais le temps imparti sera raccourci à chaque fois."],
12783=>["Value"=>12783,"TextKey"=>"新手引导说明3149","TextValue"=>"<line-height=130%>Il vous faudra attendre la session d'entraînement du héros pour monter en niveau, ou vous pouvez dépenser des <color=#38c0a5>Rubis</color> pour accélérer le processus."],
12784=>["Value"=>12784,"TextKey"=>"新手引导说明2300","TextValue"=>"<line-height=130%>Regardez, voici une <color=#46bb83>Niche d'incrustation</color>, elle contrôle une grande zone de brouillard."],
12785=>["Value"=>12785,"TextKey"=>"新手引导说明2301","TextValue"=>"<line-height=130%>Faites glisser l'objet correspondant dans la niche pour dissiper le brouillard."],
12786=>["Value"=>12786,"TextKey"=>"新手引导说明2302","TextValue"=>"<line-height=130%>Si la niche est encore endormie, vous devrez d'abord la réveiller."],
12787=>["Value"=>12787,"TextKey"=>"新手引导说明2400","TextValue"=>"<line-height=130%>Bienvenue ! L'événement n'est accessible que pour une durée limitée !"],
12788=>["Value"=>12788,"TextKey"=>"新手引导说明2401","TextValue"=>"<line-height=130%>Participer à un événement vous permet d'obtenir des tonnes de récompenses qui seront envoyées à votre Patrie !"],
12789=>["Value"=>12789,"TextKey"=>"新手引导说明2402","TextValue"=>"<line-height=130%>Vous y verrez des objets uniques, de nouvelles créatures et de nouvelles façons de jouer !"],
12790=>["Value"=>12790,"TextKey"=>"新手引导说明3180","TextValue"=>"<line-height=130%>Les flambeaux sont nécessaires pour progresser dans les niveaux ! Ils se rechargent au fil du temps."],
12791=>["Value"=>12791,"TextKey"=>"新手引导说明3181","TextValue"=>"<line-height=130%>Vous possédez des tonnes de flambeaux maintenant ! Utilisez-les pour parcourir les niveaux !"],
12792=>["Value"=>12792,"TextKey"=>"新手引导说明1072","TextValue"=>"<line-height=130%>Dorénavant, vous pouvez consulter vos <color=#38c0a5>Récompenses du camp</color> !"],
12793=>["Value"=>12793,"TextKey"=>"新手引导说明1073","TextValue"=>"<line-height=130%>Le moment venu, vous pourrez réclamer vos récompenses !"],
12794=>["Value"=>12794,"TextKey"=>"新手引导说明1074","TextValue"=>"<line-height=130%>Plus vous obtenez d'étoiles dans les niveaux, plus vous recevez de récompenses !"],
12795=>["Value"=>12795,"TextKey"=>"新手引导说明2235","TextValue"=>"<line-height=130%>Regardez ! C'est juste là sur la carte ! Débloquez-le et allez voir !"],
12796=>["Value"=>12796,"TextKey"=>"新手引导说明2310","TextValue"=>"<line-height=130%>Notre éclaireur a trouvé un endroit idéal pour établir un nouveau Camp, allez voir ça de plus près !"],
12797=>["Value"=>12797,"TextKey"=>"新手引导说明2315","TextValue"=>"<line-height=130%>Nous pourrions y rencontrer quelqu'un de vraiment intéressant !"],
12798=>["Value"=>12798,"TextKey"=>"新手引导说明2320","TextValue"=>"<line-height=130%>Bienvenue à l'<color=#46bb83>événement Escapade hivernale</color>, un monde merveilleux vous attend !"],
12799=>["Value"=>12799,"TextKey"=>"新手引导说明2321","TextValue"=>"<line-height=130%>Participer à un <color=#46bb83>événement</color> vous permet d'obtenir des tonnes de récompenses qui seront envoyées à votre <color=#f58c26>Patrie</color> !"],
12800=>["Value"=>12800,"TextKey"=>"新手引导说明2322","TextValue"=>"<line-height=130%>Vous y verrez des objets uniques, de nouvelles créatures et de nouvelles façons de jouer !"],
12801=>["Value"=>12801,"TextKey"=>"新手引导说明2330","TextValue"=>"<line-height=130%>Bienvenue à l'<color=#46bb83>événement Ville de conte de fées</color>, un monde merveilleux vous attend !"],
12802=>["Value"=>12802,"TextKey"=>"新手引导说明2331","TextValue"=>"<line-height=130%>Participer à un <color=#46bb83>événement</color> vous permet d'obtenir des tonnes de récompenses qui seront envoyées à votre <color=#f58c26>Patrie</color> !"],
12803=>["Value"=>12803,"TextKey"=>"新手引导说明2332","TextValue"=>"<line-height=130%>Vous y verrez des objets uniques, de nouvelles créatures et de nouvelles façons de jouer !"],
12804=>["Value"=>12804,"TextKey"=>"新手引导说明2340","TextValue"=>"<line-height=130%>Bienvenue à l'<color=#46bb83>événement À la mer</color>, un monde merveilleux vous attend !"],
12805=>["Value"=>12805,"TextKey"=>"新手引导说明2341","TextValue"=>"<line-height=130%>Participer à un <color=#46bb83>Événement</color> vous permet d'obtenir des tonnes de récompenses qui seront envoyées à votre <color=#f58c26>Patrie</color> !"],
12806=>["Value"=>12806,"TextKey"=>"新手引导说明2342","TextValue"=>"<line-height=130%>Vous y verrez des objets uniques, de nouvelles créatures et de nouvelles façons de jouer !"],
12807=>["Value"=>12807,"TextKey"=>"新手引导说明2350","TextValue"=>"<line-height=130%>Il s'agit d'un <color=#46bb83>objet de points d'événement</color> spécial disponible durant les événements. Touchez-le pour obtenir des <color=#46bb83>Points d'événement</color> bien juteux !"],
12808=>["Value"=>12808,"TextKey"=>"新手引导说明2352","TextValue"=>"<line-height=130%>Cette page affiche toutes les récompenses que vous pouvez obtenir en collectant des points au cours de l'événement. Lorsque vous aurez accumulé suffisamment de points, la <color=#46bb83>Récompense « Points d'événement »</color> correspondante sera envoyée à votre <color=#f58c26>Patrie</color>."],
12809=>["Value"=>12809,"TextKey"=>"新手引导说明2353","TextValue"=>"Plus vous obtenez de points, plus vous gagnerez de récompenses ! Éclatez-vous !"],
12810=>["Value"=>12810,"TextKey"=>"新手引导说明3200","TextValue"=>"<line-height=130%>Les <color=#f58c26>Missions journalières</color> sont disponibles, Allez les découvrir !"],
12811=>["Value"=>12811,"TextKey"=>"新手引导说明3203","TextValue"=>"<line-height=130%>De nombreuses <color=#f58c26>Missions journalières</color> vous attendent chaque jour. Vous serez récompensé à chaque fois que vous aurez accompli l'une d'entre elles."],
12812=>["Value"=>12812,"TextKey"=>"新手引导说明3205","TextValue"=>"<line-height=130%>Si vous accomplissez toutes les <color=#f58c26>Missions journalières</color>, vous obtiendrez un <color=#f58c26>Prix supplémentaire</color> ! "],
12813=>["Value"=>12813,"TextKey"=>"新手引导说明2420","TextValue"=>"<line-height=130%>Bonjour, je suis Miaou-miaou, et bienvenue dans le Royaume de <color=#46bb83>Miaou-Miaou</color> ! Mon merveilleux royaume vous attend !"],
12814=>["Value"=>12814,"TextKey"=>"新手引导说明2421","TextValue"=>"<line-height=130%>Participer à un <color=#46bb83>Événement</color> vous permet d'obtenir des tonnes de récompenses qui seront envoyées à votre <color=#f58c26>Patrie</color> !"],
12815=>["Value"=>12815,"TextKey"=>"新手引导说明2422","TextValue"=>"<line-height=130%>Vous y verrez des objets uniques, de nouvelles créatures (dont moi !) et de nouveaux modes de jeu !"],
12816=>["Value"=>12816,"TextKey"=>"新手引导说明2430","TextValue"=>"Où sommes-nous ? Je ne peux pas croire qu'on se trouve dans l'Égypte ancienne, où <color=#46bb83>Le Secret du Pharaon</color> attend d'être révélé !"],
12817=>["Value"=>12817,"TextKey"=>"新手引导说明2431","TextValue"=>"<line-height=130%>Participer à un <color=#46bb83>Événement</color> vous permet d'obtenir des tonnes de récompenses qui seront envoyées à votre <color=#f58c26>Patrie</color> !"],
12818=>["Value"=>12818,"TextKey"=>"新手引导说明2432","TextValue"=>"<line-height=130%>Vous y verrez des objets uniques, de nouvelles créatures (dont moi !) et de nouveaux modes de jeu !"],
12819=>["Value"=>12819,"TextKey"=>"新手引导说明2460","TextValue"=>"Salut partenaire ! Bienvenue dans le <color=#46bb83>Far West</color> !"],
12820=>["Value"=>12820,"TextKey"=>"新手引导说明2461","TextValue"=>"<line-height=130%>Participer à un <color=#46bb83>Événement</color> vous permet d'obtenir des tonnes de récompenses qui seront envoyées à votre <color=#f58c26>Patrie</color> !"],
12821=>["Value"=>12821,"TextKey"=>"新手引导说明2462","TextValue"=>"<line-height=130%>Vous y verrez des objets uniques, de nouvelles créatures (dont moi !) et de nouveaux modes de jeu !"],
12822=>["Value"=>12822,"TextKey"=>"新手引导说明2470","TextValue"=>"Il fait vraiment beau. <color=#46bb83>Le pique-nique parfait</color>!"],
12823=>["Value"=>12823,"TextKey"=>"新手引导说明2471","TextValue"=>"<line-height=130%>Participer à un <color=#46bb83>événement</color> vous permet d'obtenir des tonnes de récompenses qui seront envoyées à votre <color=#f58c26>Patrie</color> !"],
12824=>["Value"=>12824,"TextKey"=>"新手引导说明2472","TextValue"=>"<line-height=130%>Vous y verrez des objets uniques, de nouvelles créatures et de nouvelles façons de jouer !"],
12825=>["Value"=>12825,"TextKey"=>"新手引导说明2500","TextValue"=>"<line-height=130%>Il s'agit d'un <color=#46bb83>objet de points d'événement</color> spécial disponible durant les événements. Touchez-le pour obtenir des <color=#46bb83>Points d'événement</color> bien juteux !"],
12826=>["Value"=>12826,"TextKey"=>"新手引导说明2502","TextValue"=>"<line-height=130%>Cette page affiche toutes les récompenses que vous pouvez obtenir en collectant des points au cours de l'événement. Lorsque vous aurez accumulé suffisamment de points, la <color=#46bb83>Récompense « Points d'événement »</color> correspondante sera envoyée à votre <color=#f58c26>Patrie</color>."],
12827=>["Value"=>12827,"TextKey"=>"新手引导说明2503","TextValue"=>"Plus vous obtenez de points, plus vous gagnerez de récompenses ! Éclatez-vous !"],
12828=>["Value"=>12828,"TextKey"=>"新手引导说明2510","TextValue"=>"Tous vos rêves d’enfants se réalisent au <color=#46bb83>Paradis des jouets</color>!"],
12829=>["Value"=>12829,"TextKey"=>"新手引导说明2511","TextValue"=>"<line-height=130%>Participer à un <color=#46bb83>événement</color> vous permet d'obtenir des tonnes de récompenses qui seront envoyées à votre <color=#f58c26>Patrie</color> !"],
12830=>["Value"=>12830,"TextKey"=>"新手引导说明2512","TextValue"=>"<line-height=130%>Vous y verrez des objets uniques, de nouvelles créatures et de nouvelles façons de jouer !"],
12831=>["Value"=>12831,"TextKey"=>"新手引导说明2520","TextValue"=>"<line-height=130%>Il s'agit d'un <color=#46bb83>objet de points d'événement</color> spécial disponible durant les événements. Touchez-le pour obtenir des <color=#46bb83>Points d'événement</color> bien juteux !"],
12832=>["Value"=>12832,"TextKey"=>"新手引导说明2522","TextValue"=>"<line-height=130%>Cette page affiche toutes les récompenses que vous pouvez obtenir en collectant des points au cours de l'événement. Lorsque vous aurez accumulé suffisamment de points, la <color=#46bb83>Récompense « Points d'événement »</color> correspondante sera envoyée à votre <color=#f58c26>Patrie</color>."],
12833=>["Value"=>12833,"TextKey"=>"新手引导说明2523","TextValue"=>"Plus vous obtenez de points, plus vous gagnerez de récompenses ! Éclatez-vous !"],
12834=>["Value"=>12834,"TextKey"=>"新手引导说明2530","TextValue"=>"L’été, c’est la meilleure saison ! Venez vous amuser à la <color=#46bb83>Plage de vacances</color>!"],
12835=>["Value"=>12835,"TextKey"=>"新手引导说明2531","TextValue"=>"<line-height=130%>Participer à un <color=#46bb83>événement</color> vous permet d'obtenir des tonnes de récompenses qui seront envoyées à votre <color=#f58c26>Patrie</color> !"],
12836=>["Value"=>12836,"TextKey"=>"新手引导说明2532","TextValue"=>"<line-height=130%>Vous y verrez des objets uniques, de nouvelles créatures et de nouvelles façons de jouer !"],
12837=>["Value"=>12837,"TextKey"=>"新手引导说明2534","TextValue"=>"Faites glisser <color=#df66a8>Travailleur rapides</color> sur des bâtiments ou des objets pour les construire. Il peut terminer une courte construction en un clin d'œil, ou diminuer le temps d'une longue construction de 1 heure."],
12838=>["Value"=>12838,"TextKey"=>"新手引导说明2540","TextValue"=>"Bienvenue dans le <color=#f58c26> Maison des héros </color>. De nombreux héros et histoires fascinantes sont cachés ici, attendant que tu les explores !"],
12839=>["Value"=>12839,"TextKey"=>"新手引导说明2541","TextValue"=>"Fusionnez en faisant glisser une <color=#ef933d>Robe de princesse</color> sur les deux autres, pour nous aider à libérer la <color=#df66a8>Princesse tribale</color> du brouillard maléfique."],
12840=>["Value"=>12840,"TextKey"=>"新手引导说明2542","TextValue"=>"Fantastique ! Vous avez libéré le premier héros... <color=#df66a8>Princesse Tribale</color> !  <color=#df66a8>Princesse tribale</color> vous a apporté une commande de délicatesse. Tapez et regardez !"],
12841=>["Value"=>12841,"TextKey"=>"新手引导说明2543","TextValue"=>"Félicitations ! Tu as débloqué <color=#ef933d>Blé</color>, qui est un ingrédient clé pour compléter les commandes. Tape sur <color=#ef933d>Blé</color> pour le récupérer !"],
12842=>["Value"=>12842,"TextKey"=>"新手引导说明2544","TextValue"=>"<color=#38c0a5> Livres de sorts </color> peuvent vous aider à dissiper le brouillard et à libérer plus de Héros. Tu peux obtenir des <color=#38c0a5>Livres de sorts</color> en complétant des commandes."],
12843=>["Value"=>12843,"TextKey"=>"新手引导说明2631","TextValue"=>"My Kingdom and my people are lost in the fog! Can you please <color=#ef933d>Merge</color> three Imperial Crowns to help me?"],
12844=>["Value"=>12844,"TextKey"=>"新手引导说明2633","TextValue"=>"Hey! I am the Old King Hill! It seems like you are the one who woke me up!"],
12845=>["Value"=>12845,"TextKey"=>"新手引导说明2636","TextValue"=>"<color=#ef933d>Merge 3 items</color> of the <color=#ef933d>Same Kind</color> together to clear fog and unlock <color=#ef933d>New heroes</color> and other fun things."],
12846=>["Value"=>12846,"TextKey"=>"新手引导说明2637","TextValue"=>"Drag this plant onto the other two. It will be leveled up to a <color=#ef933d>New Plant</color>. Give it a try!"],
12847=>["Value"=>12847,"TextKey"=>"新手引导说明2639","TextValue"=>"Good job! Keep merging by dragging this plant onto the others. You will get an upgraded <color=#ef933d>New Plant</color>."],
12848=>["Value"=>12848,"TextKey"=>"新手引导说明2641","TextValue"=>"Keep merging the plants. You will get a <color=#ef933d>New Plant</color> of the next level."],
12849=>["Value"=>12849,"TextKey"=>"新手引导说明2643","TextValue"=>"Repeat this move and see what is the <color=#ef933d>New Plant</color> looks like."],
12850=>["Value"=>12850,"TextKey"=>"新手引导说明2645","TextValue"=>"Last step! Drag the plant you just got onto the other two same ones and you'll get a <color=#ef933d>New Plant</color> ready for harvest! "],
12851=>["Value"=>12851,"TextKey"=>"新手引导说明2649","TextValue"=>"Ahh! It's bread! It smells soo good! Let me have a taste!"],
12852=>["Value"=>12852,"TextKey"=>"新手引导说明2652","TextValue"=>"Use the spellbook now to see what's gonna happen!"],
12853=>["Value"=>12853,"TextKey"=>"新手引导说明2663","TextValue"=>"Let's try merge 5 things together and see what's gonna happen！"],
12854=>["Value"=>12854,"TextKey"=>"新手引导说明2665","TextValue"=>"Anytime when you merge 5 items together, you will get <color=#ef933d>2 Items</color> of the next level. Don't forget the rules of <color=#ef933d>3 Merge</color> and <color=#ef933d>5 Merge</color>!"],
12855=>["Value"=>12855,"TextKey"=>"新手引导说明2671","TextValue"=>"Attention! This <color=#ef933d>Crystal</color> looks magical. Let's see what's going to happen if we merge three crystals together!"],
12856=>["Value"=>12856,"TextKey"=>"新手引导说明2673","TextValue"=>"<color=#ef933d>Advanced Magic Crytal</color> can be merged with any other two items. Kind of like the wild card in poker games. Try to merge this Magic Crytal with others."],
