13617=>["Value"=>13617,"TextKey"=>"天气雷描述100001","TextValue"=>"Placez un éclair au-dessus d'un objet pour attirer les objets identiques ensemble."],
13618=>["Value"=>13618,"TextKey"=>"剧情ID1010101","TextValue"=>"<line-height=130%>Salut, mon chef, je suis Tristan, votre éclaireur ! Je suis content qu'on ait tous survécu à ce voyage cahoteux. Nous avons enfin atteint la terre ferme, établissons donc notre <color=#f58c26>Campement</color>. "],
13619=>["Value"=>13619,"TextKey"=>"剧情ID1010102","TextValue"=>"<line-height=130%>C'est vraiment verdoyant ! On ne sait jamais sur quoi on va tomber dans cette région ! Commençons par monter notre tente pour nous protéger !"],
13620=>["Value"=>13620,"TextKey"=>"剧情ID1010201","TextValue"=>"<line-height=130%>Oh mon Dieu, regardez cette saleté répugnante... et cette tente crasseuse ! Ma patrie me manque tellement..."],
13621=>["Value"=>13621,"TextKey"=>"剧情ID1010202","TextValue"=>"Écoute, Edna, je sais que c'est dur de quitter son foyer, mais le seul moyen de le sauver était de partir. Tous ces désastres étranges... il nous faut trouver une réponse ! C'est pourquoi on a pensé à demander de l'aide."],
13622=>["Value"=>13622,"TextKey"=>"剧情ID1010203","TextValue"=>"<line-height=130%>Mais on trouvera un moyen de rentrer, ok ? Commençons par construire un <color=#f58c26>Autel</color> pour que vous puissiez parler à Dieu, qu'en dites-vous, prêtresse Edna ? Le chef va nous aider !"],
13623=>["Value"=>13623,"TextKey"=>"剧情ID1020101","TextValue"=>"<line-height=130%>Regarde ce qu'on a trouvé ! L'<color=#ef933d>Héritage sauvage</color> ! C'est tout ce dont on a besoin pour l'<color=#f58c26>Autel</color>, et on a découvert un moyen de se libérer de ces totems ! Cet endroit est béni !"],
13624=>["Value"=>13624,"TextKey"=>"剧情ID1020201","TextValue"=>"<line-height=130%>Je suppose que tu n'es pas complètement inutile, Stan-truc. Même si c'est beaucoup plus petit et décevant que ce que j'avais à la maison, ça me conviendra pour l'instant ! Maintenant, pars !"],
13625=>["Value"=>13625,"TextKey"=>"剧情ID1020202","TextValue"=>"<line-height=130%>Oh, comme c'est mignon ! Regarde comme elle est heureuse, c'est sa façon un peu tordue de dire merci !"],
13626=>["Value"=>13626,"TextKey"=>"剧情ID1020203","TextValue"=>"<line-height=130%> (Termine une danse étrange) Notre dieu m'a dit que nous sommes au bon endroit et qu'un éminent personnage va venir nous aider..."],
13627=>["Value"=>13627,"TextKey"=>"剧情ID1020204","TextValue"=>"<line-height=130%>Vraiment ? C'est une grande nouvelle ! Quand doit-il arriver ?"],
13628=>["Value"=>13628,"TextKey"=>"剧情ID1020301","TextValue"=>"<line-height=130%>C'est vous les coquins qui avez perturbé mon sommeil ?! "],
13629=>["Value"=>13629,"TextKey"=>"剧情ID1020302","TextValue"=>"<line-height=130%>... Et vous êtes ?"],
13630=>["Value"=>13630,"TextKey"=>"剧情ID1020303","TextValue"=>"<line-height=130%>Je suis l'Archidruide, père des bardes, conquérant des tempêtes, protecteur des aventuriers, terrifiant messager de Dieu, exécuteur et juge, l'Amorgen chantant ! "],
13631=>["Value"=>13631,"TextKey"=>"剧情ID1020304","TextValue"=>"<line-height=130%>Ah... Enchanté de vous rencontrer, je suppose ? Nous sommes nouveaux dans la région et nous venons d'apprendre..."],
13632=>["Value"=>13632,"TextKey"=>"剧情ID1020305","TextValue"=>"<line-height=130%>Quoi ?! Vous êtes des envahisseurs ?! Vous n'aurez aucune chance de détruire notre foyer et de désunir nos familles ! "],
13633=>["Value"=>13633,"TextKey"=>"剧情ID1020401","TextValue"=>"Quoi ? Non, non ! Nous ne sommes pas des envahisseurs, nous essayons juste de trouver un endroit pour nous reposer et peut-être résoudre le mystère de notre patrie..."],
13634=>["Value"=>13634,"TextKey"=>"剧情ID1020402","TextValue"=>"Non ! Le pont ! Regardez ce que vous avez fait ! Ciel, on est cuits ! Attendez... Qui avez-vous dit que vous étiez ? Amorgen ? Amorgen l'Archidruide ? Celui des légendes ?!"],
13635=>["Value"=>13635,"TextKey"=>"剧情ID1020403","TextValue"=>"Vous n'êtes... pas des envahisseurs ? Qui êtes-vous ? Pourquoi êtes-vous ici ? Attendez... Pourquoi suis-je ici, et quel est cet endroit ? Où est passé mon peuple ? Je ne reconnais pas cette contrée..."],
13636=>["Value"=>13636,"TextKey"=>"剧情ID1020404","TextValue"=>"Je suis désolé, mais nous n'avons pas non plus de réponses. Nous avons voyagé loin, risqué nos vies pour arriver jusqu'ici, en essayant de trouver des personnes capables de résoudre le mystère de notre patrie. D'abord un épais brouillard s'est abattu sur nous, puis..."],
13637=>["Value"=>13637,"TextKey"=>"剧情ID1020405","TextValue"=>"L'année dernière, nous avons eu plus d'inondations que durant la dernière décennie. Mais le plus curieux, c'est que les gens se sont transformés en totems sans vie ! Rendez-vous compte ?!"],
13638=>["Value"=>13638,"TextKey"=>"剧情ID1020406","TextValue"=>"Oh... c'est... beaucoup à encaisser. Désolé de vous avoir attaqué et d'avoir détruit votre pont. Peut-être que je peux aider à le reconstruire ?"],
13639=>["Value"=>13639,"TextKey"=>"剧情ID1020407","TextValue"=>"Amorgen ?! Le puissant Amorgen ?! Votre tunique, votre capacité à commander la tempête... Vous existez réellement ! Cela signifie que les contes dans le livre de ma famille sont bien réels !"],
13640=>["Value"=>13640,"TextKey"=>"剧情ID1020408","TextValue"=>"<line-height=130%>Ouvriers ! Ressaisissez-vous et reconstruisez ce pont !"],
13641=>["Value"=>13641,"TextKey"=>"剧情ID1020409","TextValue"=>"<line-height=130%>Mais nous sommes blessés ! Nous ne pouvons pas commencer à construire maintenant ! "],
13642=>["Value"=>13642,"TextKey"=>"剧情ID1020410","TextValue"=>"Je sais exactement ce qu'il faut faire. J'ai appris la phytothérapie au cours de mes années de voyage. Rassemblons quelques herbes et faisons pousser un <color=#f58c26>Jardin d'herbes aromatiques</color> ici, c'est ma façon de m'excuser."],
13643=>["Value"=>13643,"TextKey"=>"剧情ID1020411","TextValue"=>"Merci ! C'est très gentil de votre part. Nous retournerons aussi chez nous plus tard pour libérer ceux qui sont piégés dans les totems maintenant que nous avons appris comment faire ! Super, allons-y !"],
13644=>["Value"=>13644,"TextKey"=>"剧情ID1030101","TextValue"=>"<line-height=130%>Nous sommes de retour, avec des bras en plus ! Allons donc construire le jardin !"],
13645=>["Value"=>13645,"TextKey"=>"剧情ID1030201","TextValue"=>"<line-height=130%>Waouh, je suis vraiment impressionné, vous êtes vraiment doué pour ça. Ce petit jardin est magnifique. "],
13646=>["Value"=>13646,"TextKey"=>"剧情ID1030202","TextValue"=>"<line-height=130%>Et très utile aussi. Les ouvriers sont maintenant soignés et seront bientôt prêts à reconstruire le pont !"],
13647=>["Value"=>13647,"TextKey"=>"剧情ID1030203","TextValue"=>"<line-height=130%>Ravi d'avoir pu aider."],
13648=>["Value"=>13648,"TextKey"=>"剧情ID1030204","TextValue"=>"À ce propos, en fait, le Prêtre ici présent était justement en train de dire à quel point vous êtes vertueux et bien informé. Ce que j'essaie de dire, c'est que..."],
13649=>["Value"=>13649,"TextKey"=>"剧情ID1030205","TextValue"=>"Ce serait un honneur si un aventurier expérimenté, qui plus est aussi prestigieux, pouvait se joindre à nous. Mais vous êtes une légende ! Pas question que vous vous joigniez à de simples inconnus ! Le ferez-vous ? S'il vous plaît ? S'il vous plaît, accompagnez-nous !!!"],
13650=>["Value"=>13650,"TextKey"=>"剧情ID1030206","TextValue"=>"<line-height=130%>Bien évidemment. C'est peut-être exactement pour cette raison que j'ai été envoyé ici."],
13651=>["Value"=>13651,"TextKey"=>"剧情ID1030207","TextValue"=>"<line-height=130%>Je le savais. Vous ne... QUOI ?! Vous allez venir avec nous ?! Oh je ne peux pas le croire... C'est le plus beau jour de ma VIE ! "],
13652=>["Value"=>13652,"TextKey"=>"剧情ID1030208","TextValue"=>"Désolé pour ça, elle peut parfois s'emballer. Maintenant que vous nous avez rejoints, que diriez-vous d'organiser une fête de bienvenue en votre honneur ?"],
13653=>["Value"=>13653,"TextKey"=>"剧情ID1030209","TextValue"=>"Non, je me passerai bien d'une fête, j'ai des choses plus urgentes à régler. Je vais chercher du bois pour reconstruire ce pont que j'ai cassé."],
13654=>["Value"=>13654,"TextKey"=>"剧情ID1030210","TextValue"=>"<line-height=130%>Quel homme honorable ! Oh ! Rien que de le rencontrer... Le meilleur jour de ma VIE !"],
13655=>["Value"=>13655,"TextKey"=>"剧情ID1040101","TextValue"=>"<line-height=130%>C'est vous le Chef... n'est-ce pas ? Merci pour l'aide que vous nous avez apportée là-bas. Maintenant, nous sommes prêts à reconstruire ce pont."],
13656=>["Value"=>13656,"TextKey"=>"剧情ID1040201","TextValue"=>"<line-height=130%>Comme neuf ! Maintenant, êtes-vous impatient d'aller parler à Dieu à nouveau, Prêtresse Edna ?"],
13657=>["Value"=>13657,"TextKey"=>"剧情ID1040202","TextValue"=>"<line-height=130%>Plus prête que jamais ! "],
13658=>["Value"=>13658,"TextKey"=>"剧情ID1040301","TextValue"=>"<line-height=130%>Ok, Chef, pendant que la prêtresse profite de ses retrouvailles avec son cher autel, nous pouvons nous mettre au travail..."],
13659=>["Value"=>13659,"TextKey"=>"剧情ID1040401","TextValue"=>"Aïe, qu'est-ce qui m'a fait trébucher ? Huh, je vois, un morceau de <color=#38c0a5>Minerai sauvage</color> provenant de l'<color=#f58c26>Autel</color>. Vous êtes terriblement négligents quand vous travaillez."],
13660=>["Value"=>13660,"TextKey"=>"剧情ID1040402","TextValue"=>"<line-height=130%>Ah ha, je sais ! Il nous faut construire un <color=#f58c26>Entrepôt</color> pour stocker les ressources, afin que les gens ne trébuchent pas sur les matériaux qui traînent partout."],
13661=>["Value"=>13661,"TextKey"=>"剧情ID1050101","TextValue"=>"<line-height=130%>Vous avez tout ce dont nous avons besoin ? Alors, que la fête commence ! Désolé, je veux dire l'<color=#f58c26>Entrepôt</color>."],
13662=>["Value"=>13662,"TextKey"=>"剧情ID1050201","TextValue"=>"<line-height=130%>Un mur solide, un bel et grand espace... Superbes talents de constructeur, Chef !"],
13663=>["Value"=>13663,"TextKey"=>"剧情ID1050202","TextValue"=>"<line-height=130%>Euh... Chef ? Il y a un machin à huit pattes juste derrière vous."],
13664=>["Value"=>13664,"TextKey"=>"剧情ID1050301","TextValue"=>"Quoi ?! Comment ?! Qu'est-ce que c'est ?! On dirait le corps d'une sorte de créature aquatique... hmm et la peau est visqueuse et élastique !"],
13665=>["Value"=>13665,"TextKey"=>"剧情ID1050302","TextValue"=>"<line-height=130%><color=#f58c26>Kraken</color> ! C'est un <color=#f58c26>Kraken</color> ! J'ai lu à leur sujet dans mes livres ! Ce doit être le bébé de ce monstre ! Pourquoi y a-t-il un <color=#f58c26>Kraken</color> ?!"],
13666=>["Value"=>13666,"TextKey"=>"剧情ID1050303","TextValue"=>"Inutile de paniquer. D'une part, il est bel et bien mort, et d'autre part, il ne s'agit que d'une <color=#f58c26>Pieuvre</color> banale échouée."],
13667=>["Value"=>13667,"TextKey"=>"剧情ID1050304","TextValue"=>"<line-height=130%>Une Pieuvre ? Jamais entendu parler..."],
13668=>["Value"=>13668,"TextKey"=>"剧情ID1050305","TextValue"=>"Cela signifie que vous devez venir des terres intérieures, hein. Mon peuple est nomade. Nous dépendons de la mer. Pour nous, les pieuvres sont aussi banales que les étoiles dans le ciel nocturne."],
13669=>["Value"=>13669,"TextKey"=>"剧情ID1050306","TextValue"=>"En fait, venez avec moi, nous allons trouver des cordes et des branches. Je vais vous montrer comment construire une tente avec la peau d'une pieuvre."],
13670=>["Value"=>13670,"TextKey"=>"剧情ID1060101","TextValue"=>"<line-height=130%>Et voilà... le travail. Cela avait l'air bien mieux dans mon imagination."],
13671=>["Value"=>13671,"TextKey"=>"剧情ID1060102","TextValue"=>"<line-height=130%>C'est... euh... euh... adorable !"],
13672=>["Value"=>13672,"TextKey"=>"剧情ID1060103","TextValue"=>"Désolé. Je suis plus adepte de la théorie que de la pratique. La construction n'est pas mon point fort. Maintenant... je pourrais avoir besoin de m'allonger..."],
13673=>["Value"=>13673,"TextKey"=>"剧情ID1060104","TextValue"=>"Ô grand Amorgen ! Allez donc vous reposer dans la tente principale et je vous tiendrai compagnie ! Vous m'avez transmis votre sagesse et je serai à jamais à votre service."],
13674=>["Value"=>13674,"TextKey"=>"剧情ID1060201","TextValue"=>"Ce doit être un rêve d'enfant devenu réalité pour la prêtresse. Je suis heureux de voir que ces deux-là s'entendent bien. Cependant, tout cela semble un peu louche, vous ne trouvez pas, chef ?"],
13675=>["Value"=>13675,"TextKey"=>"剧情ID1060202","TextValue"=>"Les doyens ont dit que ceux qui avaient voyagé jusqu'à la mer n'étaient jamais revenus, à l'exception de celui qui était revenu fou, parlant d'une barrière d'eau géante au bout du monde."],
13676=>["Value"=>13676,"TextKey"=>"剧情ID1060203","TextValue"=>"<line-height=130%>Pourtant, cet Amorgen a dit qu'ils étaient un peuple de la mer ! Aucun peuple ne vit sur la mer !"],
13677=>["Value"=>13677,"TextKey"=>"剧情ID1060204","TextValue"=>"<line-height=130%>C'est pourquoi c'est curieux. Mais de toute façon, il ne nous a fait aucun mal. Concentrons-nous sur nos tâches pour l'instant. "],
13678=>["Value"=>13678,"TextKey"=>"剧情ID1060205","TextValue"=>"<line-height=130%>Maintenant que vous avez exploré les environs, la quantité de trophées que nous avons trouvée est considérable. Du bétail peut aider à les ramener à bon port et pour leur confort, nous devrions construire une <color=#f58c26>Étable</color>."],
13679=>["Value"=>13679,"TextKey"=>"剧情ID1070101","TextValue"=>"<line-height=130%>Vous avez bonne mine, Chef ! On dirait que ces petits gars vont nous être utiles tout de suite, fantastique !"],
13680=>["Value"=>13680,"TextKey"=>"剧情ID1070102","TextValue"=>"<line-height=130%>Nous avons presque terminé les constructions, mais il y a une dernière chose pour laquelle j'aurais besoin de votre aide."],
13681=>["Value"=>13681,"TextKey"=>"剧情ID1070103","TextValue"=>"<line-height=130%>Au cas où des personnes mal intentionnées viendraient ruiner notre camp en notre absence, il nous faut une équipe d'éclaireurs professionnels pour patrouiller dans la zone et protéger nos travaux sur place."],
13682=>["Value"=>13682,"TextKey"=>"剧情ID1070104","TextValue"=>"<line-height=130%>Il va nous falloir un <color=#f58c26>Cercle d'entraînement</color> !"],
13683=>["Value"=>13683,"TextKey"=>"剧情ID1070105","TextValue"=>"<line-height=130%>Tu as bien entendu, Kevin, un <color=#f58c26>Cercle d'entraînement</color>. Allons trouver des matériaux !"],
13684=>["Value"=>13684,"TextKey"=>"剧情ID1080101","TextValue"=>"<line-height=130%>Es-tu prêt ?"],
13685=>["Value"=>13685,"TextKey"=>"剧情ID1080102","TextValue"=>"<line-height=130%>Oui, chef !"],
13686=>["Value"=>13686,"TextKey"=>"剧情ID1080103","TextValue"=>"<line-height=130%>Le chef a fini de préparer les matériaux, alors commençons !"],
13687=>["Value"=>13687,"TextKey"=>"剧情ID1080104","TextValue"=>"<line-height=130%>Oui, chef ! Pas de problème, chef !"],
13688=>["Value"=>13688,"TextKey"=>"剧情ID1080201","TextValue"=>"<line-height=130%>Bon travail ! Et maintenant nous... Prêtresse ? Qu'est-ce qu'il y a ?"],
13689=>["Value"=>13689,"TextKey"=>"剧情ID1080301","TextValue"=>"Je parlais avec l'Archidruide Amorgen, puis nous nous sommes tous les deux endormis à cause de la fatigue et nous avons fait ce rêve étrange dans lequel une déesse nous disait de sauver le <color=#f58c26>Cœur de la mer</color>...."],
13690=>["Value"=>13690,"TextKey"=>"剧情ID1080302","TextValue"=>"<line-height=130%><color=#f58c26>Le Cœur de la mer</color> ? Qu'est-ce que c'est ?"],
13691=>["Value"=>13691,"TextKey"=>"剧情ID1080303","TextValue"=>"Un vieux conte parle d'un dôme géant dans la mer, protégée par la plus jeune des Déesses. Sous ce dôme, non seulement les animaux préhistoriques ont survécu, mais des géants et des fées y vivent encore. Rien de plus qu'une histoire à dormir debout."],
13692=>["Value"=>13692,"TextKey"=>"剧情ID1080304","TextValue"=>"<line-height=130%>Je dois en avoir le cœur net. Afin d'obtenir un message plus clair de la Déesse, je vais avoir besoin d'une <color=#f58c26>Puissante base runique</color>."],
13693=>["Value"=>13693,"TextKey"=>"剧情ID1080305","TextValue"=>"<line-height=130%>Bien reçu. Ok, Chef, allons chercher du Minerai de fer sauvage et construisons cette base pour Edna."],
13694=>["Value"=>13694,"TextKey"=>"剧情ID1090101","TextValue"=>"<line-height=130%>Nous avons presque terminé ! Nous devons fêter ça !"],
13695=>["Value"=>13695,"TextKey"=>"剧情ID1090102","TextValue"=>"<line-height=130%>Hourra !"],
13696=>["Value"=>13696,"TextKey"=>"剧情ID1090201","TextValue"=>"<line-height=130%>Ne vous réjouissez pas trop vite ! Je ne peux pas me concentrer quand vous faites autant de bruit !"],
13697=>["Value"=>13697,"TextKey"=>"剧情ID1090202","TextValue"=>"<line-height=130%>J'essayais de me reconnecter avec Dieu et j'ai échoué par votre faute, bande d'idiots tapageurs !"],
13698=>["Value"=>13698,"TextKey"=>"剧情ID1090203","TextValue"=>"<line-height=130%>Fermez-la et laissez-moi tranquille !"],
13699=>["Value"=>13699,"TextKey"=>"剧情ID1090204","TextValue"=>"<line-height=130%>Aïe, on dirait bien que quelqu'un passe une mauvaise journée."],
13700=>["Value"=>13700,"TextKey"=>"剧情ID1090205","TextValue"=>"<line-height=130%>Un instant ! Chut ! Je crois que je l'entends. C'est très important."],
13701=>["Value"=>13701,"TextKey"=>"剧情ID1090206","TextValue"=>"Hmm... Je n'arrive pas à entendre très clairement... mais ce que je devine, c'est que... nous devrions aller vers le nord, là où rien ne peut pousser et où rien ne peut vivre. Là-bas, nous trouverons un ami."],
13702=>["Value"=>13702,"TextKey"=>"剧情ID1090207","TextValue"=>"<line-height=130%>Ok, ça semble... faisable ? Je veux dire, que peut-il arriver de pire ? On y va pour le Nord ! "],
13703=>["Value"=>13703,"TextKey"=>"剧情ID1090208","TextValue"=>"Mais avant cela, il est enfin temps de fêter notre tout nouveau Campement ! Rassemblez-vous, car nous allons faire une grande fête !"],
13704=>["Value"=>13704,"TextKey"=>"剧情ID1090209","TextValue"=>"<line-height=130%>Hourra !"],
13705=>["Value"=>13705,"TextKey"=>"剧情ID1090301","TextValue"=>"Nous sommes partis de chez nous en pensant que nous ne reviendrions peut-être jamais et pourtant nous sommes tombés sur cette île incroyable, nous avons rencontré de nouveaux amis et nous avons même trouvé le moyen de faire revivre des membres de tribus que nous pensions morts à jamais."],
13706=>["Value"=>13706,"TextKey"=>"剧情ID1090302","TextValue"=>"Pour tout cela, nous devons remercier notre Déesse qui a veillé sur nous et nous a guidés, notre nouvel ami, ce cher Amorgen, qui nous a généreusement fait bénéficier de son incroyable savoir."],
13707=>["Value"=>13707,"TextKey"=>"剧情ID1090303","TextValue"=>"Mais par-dessus tout, Chef, nous n'aurions pas pu accomplir tout cela si vous n'étiez pas resté fort et bienveillant. Alors merci Chef, pour tout ce que vous avez fait pour nous, et... euh... Prêtresse, êtes-vous en train de pleurer ?"],
13708=>["Value"=>13708,"TextKey"=>"剧情ID1090304","TextValue"=>"Je... Je ne... *sniff* pleure... p-pas... c'est juste...*sniff* Ok je pleure ! Je pleure ! Vous êtes contents maintenant ?! Je vous aime Chef ! Vous êtes le meilleur des Chefs !! "],
13709=>["Value"=>13709,"TextKey"=>"剧情ID1090305","TextValue"=>"Haha, tout est dit, Chef. J'ai hâte de voir comment se déroulera notre voyage à venir. Je suis sûr qu'un jour, nous parviendrons à résoudre le mystère qui entoure notre patrie, et à rebâtir un endroit où nous nous sentirons chez nous."],
13710=>["Value"=>13710,"TextKey"=>"剧情ID2010101","TextValue"=>"<line-height=130%>Ne vous pressez pas les gars, nous sommes presque arrivés..."],
13711=>["Value"=>13711,"TextKey"=>"剧情ID2010102","TextValue"=>"<line-height=130%>Louez soit la Déesse ! Nous marchons dans ce désert depuis des jours mais peut-être pourriez-vous me donner un peu d'eau ? "],
13712=>["Value"=>13712,"TextKey"=>"剧情ID2010103","TextValue"=>"<line-height=130%>Un peu de patience ! À ton âge... Hé, qu'est-ce que c'est ?"],
13713=>["Value"=>13713,"TextKey"=>"剧情ID2010201","TextValue"=>"<line-height=130%>WOAAAAAAH !"],
13714=>["Value"=>13714,"TextKey"=>"剧情ID2010202","TextValue"=>"<line-height=130%>Prêtresse ?!"],
13715=>["Value"=>13715,"TextKey"=>"剧情ID2010203","TextValue"=>"<line-height=130%>Oh non, vous êtes en bas, ma prêtresse ? Est-ce que vous allez bien ?"],
13716=>["Value"=>13716,"TextKey"=>"剧情ID2010204","TextValue"=>"<line-height=130%>Eh bien... je suis encore en vie... Hmm, je pense que j'ai été entraînée par cette... mine magique ?"],
13717=>["Value"=>13717,"TextKey"=>"剧情ID2010205","TextValue"=>"<line-height=130%>Oh Dieu merci, vous allez bien ! Ne vous inquiétez pas, nous ferons tout ce que nous pouvons pour vous sortir de là dès que possible."],
13718=>["Value"=>13718,"TextKey"=>"剧情ID2010301","TextValue"=>"<line-height=130%>Chef, j'ai trouvé un bâtiment abandonné sur le sommet d'une colline à proximité. J'ai pu voir une grosse machine à corde de paille à l'intérieur, mais elle est entourée d'un désordre épouvantable."],
13719=>["Value"=>13719,"TextKey"=>"剧情ID2010302","TextValue"=>"<line-height=130%>Je suppose qu'il s'agit plutôt d'un <color=#f58c26>Ancien atelier</color>."],
13720=>["Value"=>13720,"TextKey"=>"剧情ID2010303","TextValue"=>"<line-height=130%>Nous pouvons essayer de l'ouvrir et de nettoyer sa porte afin de pouvoir fabriquer une poulie en corde pour sortir la prêtresse de là."],
13721=>["Value"=>13721,"TextKey"=>"剧情ID2010304","TextValue"=>"<line-height=130%>Eh bien, cessez de bavarder et allez fabriquer ce bidule à poulie !"],
13722=>["Value"=>13722,"TextKey"=>"剧情ID2010305","TextValue"=>"Calmez-vous, prêtresse ! Le ciel commence à s'assombrir, il va bientôt geler dehors ! Nous devons d'abord trouver des matériaux pour monter une <color=#f58c26>Tente</color> et essayer de trouver une solution après que tout le monde se sera reposé."],
13723=>["Value"=>13723,"TextKey"=>"剧情ID2010306","TextValue"=>"<line-height=130%>Mais qu'en est-il de moi ? ! Je pourrais mourir de froid !"],
13724=>["Value"=>13724,"TextKey"=>"剧情ID2010307","TextValue"=>"<line-height=130%>Ne vous inquiétez pas, bien que la différence de température au-dessus du sol entre le jour et la nuit soit énorme, la température sous terre est toujours stable et agréable. Tenez bon, prêtresse ! "],
13725=>["Value"=>13725,"TextKey"=>"剧情ID2020101","TextValue"=>"Le lendemain..."],
13726=>["Value"=>13726,"TextKey"=>"剧情ID2020201","TextValue"=>"<line-height=130%>J'ai bien dormi cette nuit ! Comment vous vous en sortez en bas, ma prêtresse ?"],
13727=>["Value"=>13727,"TextKey"=>"剧情ID2020202","TextValue"=>"<line-height=130%>J'apprécierais que vous dépensiez votre énergie à me faire sortir d'ici au lieu de me demander comment je vais !"],
13728=>["Value"=>13728,"TextKey"=>"剧情ID2020203","TextValue"=>"<line-height=130%>On y travaille, j'ai juste besoin d'outils pour ouvrir cette porte avant de commencer. Veuillez garder votre calme. *Sourire*"],
13729=>["Value"=>13729,"TextKey"=>"剧情ID2020204","TextValue"=>"<line-height=130%>Attends que je sorte de là... Petit morveux ingrat et irrespectueux..."],
13730=>["Value"=>13730,"TextKey"=>"剧情ID2020205","TextValue"=>"<line-height=130%>Aïe, je suis profondément blessé ! Comment se fait-il que vous ayez mal interprété mes bonnes intentions de la sorte !? Mais je vous pardonne. Le Chef et moi revenons tout de suite !"],
13731=>["Value"=>13731,"TextKey"=>"剧情ID2030201","TextValue"=>"Ok, on y est ! Maintenant, il ne nous reste plus qu'à..."],
13732=>["Value"=>13732,"TextKey"=>"剧情ID2030202","TextValue"=>"Chef, attention ! Derrière vous !"],
13733=>["Value"=>13733,"TextKey"=>"剧情ID2030203","TextValue"=>"Aïe ! D'où vient cette flèche ?!"],
13734=>["Value"=>13734,"TextKey"=>"剧情ID2030204","TextValue"=>"Sortez du bâtiment !"],
13735=>["Value"=>13735,"TextKey"=>"剧情ID2030205","TextValue"=>"Qui va là ?"],
13736=>["Value"=>13736,"TextKey"=>"剧情ID2030206","TextValue"=>"Sortez ! Sale kidnappeur !"],
13737=>["Value"=>13737,"TextKey"=>"剧情ID2030207","TextValue"=>"Kidnappeur ? Je pense que vous vous trompez de personne, madame la voix... Aïe, aïe, aïe !"],
13738=>["Value"=>13738,"TextKey"=>"剧情ID2030301","TextValue"=>"Madame la voix, nous sommes sortis du bâtiment, voulez-vous à présent m'expliquer ce qui se passe ?"],
13739=>["Value"=>13739,"TextKey"=>"剧情ID2030302","TextValue"=>"Tout d'abord, je ne m'appelle pas Madame la voix, je suis Tlachtga, chasseuse de foudre, fille de Mug Ruith, mère de toutes les terres, héroïne du...."],
13740=>["Value"=>13740,"TextKey"=>"剧情ID2030303","TextValue"=>"<size=100%>Grande Tlachtga !!!!!!!!!!!"],
13741=>["Value"=>13741,"TextKey"=>"剧情ID2030304","TextValue"=>"Qui... D'où vient cette voix... du pied de la colline ? Quelqu'un est tombé dans cette mine ?"],
13742=>["Value"=>13742,"TextKey"=>"剧情ID2030305","TextValue"=>"Vous trois, restez parfaitement immobiles jusqu'à ce que je revienne. Si je découvre que vous avez bougé d'un pouce, vous allez voir de quel bois je me chauffe."],
13743=>["Value"=>13743,"TextKey"=>"剧情ID2030306","TextValue"=>"Oui, Madame, pas d'un pouce !"],
13744=>["Value"=>13744,"TextKey"=>"剧情ID2030401","TextValue"=>"Vous voilà. Une prêtresse ? Que faites-vous là ? J'ai défoncé l'entrée de cette mine alors que je cherchais quelqu'un, comment se fait-il que vous soyez là ?"],
13745=>["Value"=>13745,"TextKey"=>"剧情ID2030402","TextValue"=>"Pour faire court, j'étais avec les trois garçons que vous venez d'attraper, mais je suis tombée dans cette mine. Mais peu importe. Vous êtes là ! J'ai prédit que nous rencontrerions un ami qui pourrait nous aider sur cette terre aride, je n'arrive pas à croire que c'est vous !"],
13746=>["Value"=>13746,"TextKey"=>"剧情ID2030403","TextValue"=>"<line-height=130%>Un ami ? Vous aider ? Pour quoi faire ? Vous n'êtes... pas des kidnappeurs ?"],
13747=>["Value"=>13747,"TextKey"=>"剧情ID2030404","TextValue"=>"<line-height=130%>Des kidnappeurs ? Non non non, nous ne faisons que passer, en quête d'aide pour sauver notre patrie ! *Explique*"],
13748=>["Value"=>13748,"TextKey"=>"剧情ID2030405","TextValue"=>"Je vois. Maintenant que vous en parlez, Mère m'a parlé de la possibilité de rencontrer un groupe de personnes dans votre genre... mais ensuite elle a disparu... Ça veut donc dire que je me suis trompée de personnes."],
13749=>["Value"=>13749,"TextKey"=>"剧情ID2030406","TextValue"=>"<line-height=130%>Votre mère ?"],
13750=>["Value"=>13750,"TextKey"=>"剧情ID2030407","TextValue"=>"Oubliez ça, ce n'est pas important. Je suppose que vos gars sont tombés dans mon piège en essayant de faire marcher cette machine à corde, afin de vous repêcher ?"],
13751=>["Value"=>13751,"TextKey"=>"剧情ID2030408","TextValue"=>"<line-height=130%>Oui sage madame, c'est exactement pourquoi et comment j'ai fini par avoir l'allure d'un unijambiste."],
13752=>["Value"=>13752,"TextKey"=>"剧情ID2030409","TextValue"=>"Oh là là, je suis désolée, je vous aiderai à soigner votre blessure plus tard. Pour l'instant, laissez-moi enlever mes pièges et réparer cette machine à corde pour vous..."],
13753=>["Value"=>13753,"TextKey"=>"剧情ID2030501","TextValue"=>"<line-height=130%>La machine à corde à paille est en place et fonctionne, beau travail, madame !"],
13754=>["Value"=>13754,"TextKey"=>"剧情ID2030592","TextValue"=>"<line-height=130%>C'est pas génial du tout ! Remontez-moi ! Tout de suite, immédiatement !"],
13755=>["Value"=>13755,"TextKey"=>"剧情ID2030683","TextValue"=>"<line-height=130%>Il ne reste qu'une étape. Nous devons seulement préparer la corde de paille et la poulie avant de pouvoir vous repêcher."],
13756=>["Value"=>13756,"TextKey"=>"剧情ID2030774","TextValue"=>"<line-height=130%>J'ai l'impression que vous me prenez pour cible... *Les larmes aux yeux*."],
13757=>["Value"=>13757,"TextKey"=>"剧情ID2040101","TextValue"=>"<line-height=130%>Chef, vous avez déjà fini de rassembler les matériaux ? C'est normal de prendre son temps, car depuis qu'Edna n'est plus là, on peut enfin avoir la paix dans le coin..."],
13758=>["Value"=>13758,"TextKey"=>"剧情ID2040102","TextValue"=>"<line-height=130%>Je vous entends d'ici, vous savez ?"],
13759=>["Value"=>13759,"TextKey"=>"剧情ID2040103","TextValue"=>"<line-height=130%>Oops ! Je ne savais pas qu'elle pouvait nous entendre... Aha, la poulie est prête !"],
13760=>["Value"=>13760,"TextKey"=>"剧情ID2040201","TextValue"=>"<line-height=130%>Chère prêtresse, l'équipe de secours est en panne, veuillez-vous montrer pour qu'on ne vous marche pas dessus...."],
13761=>["Value"=>13761,"TextKey"=>"剧情ID2040202","TextValue"=>"<line-height=130%>Vous me marchez dessus ! Dégagez ! "],
13762=>["Value"=>13762,"TextKey"=>"剧情ID2040203","TextValue"=>"<line-height=130%>On dirait que la prêtresse sera bientôt sortie d'affaire, merci beaucoup, madame."],
13763=>["Value"=>13763,"TextKey"=>"剧情ID2040204","TextValue"=>"<line-height=130%>Ne m'appellez pas madame, mon nom est Tlachtga. Bon, voyons voir, où est-ce que je vous ai fait mal à l'instant ?"],
13764=>["Value"=>13764,"TextKey"=>"剧情ID2040205","TextValue"=>"<line-height=130%>Vous m'avez eu sur le tibia, madam... euh, Tlachtga."],
13765=>["Value"=>13765,"TextKey"=>"剧情ID2040206","TextValue"=>"<line-height=130%>Je vous tiens. Les chasseurs comme moi s'y connaissent en premiers soins. J'ai un sac de feuilles succulentes en bas dans la mine. Je l'utilise comme entrepôt. Faisons-en pousser quelques-unes et frottons ce jus sur votre jolie gambette !"],
13766=>["Value"=>13766,"TextKey"=>"剧情ID2040207","TextValue"=>"<line-height=130%>Euh... gambette... ok. Donc on devrait y aller maintenant ? "],
13767=>["Value"=>13767,"TextKey"=>"剧情ID2040208","TextValue"=>"Non non non, vous, les petits gringalets, aurez besoin de flambeaux pour voir là-dessous. C'est beaucoup plus profond que vous ne le pensez. Allez chercher des torches et des outils d'excavation !"],
13768=>["Value"=>13768,"TextKey"=>"剧情ID2050101","TextValue"=>"<line-height=130%>Tenez ça, si le feu s'éteint, arrêtez-vous et faites demi-tour, compris ?"],
13769=>["Value"=>13769,"TextKey"=>"剧情ID2050102","TextValue"=>"<line-height=130%>Prêts ? Allons-y ! Attention où vous mettez les pieds !"],
13770=>["Value"=>13770,"TextKey"=>"剧情ID2050103","TextValue"=>"<line-height=130%>Oui, Madame !"],
13771=>["Value"=>13771,"TextKey"=>"剧情ID2050104","TextValue"=>"Chef, merci de rester ici avec la Prêtresse et moi. Je suis assez triste de ne pas pouvoir vous accompagner, mais Tlachtga a dit que je ferais mieux de rester ici si je ne veux pas perdre ma jambe. J'ai hâte de voir ce qu'ils vont nous apporter !"],
13772=>["Value"=>13772,"TextKey"=>"剧情ID2050105","TextValue"=>"<line-height=130%>Je n'arrive pas à croire que la Grande Tlachtga vous ait permise de l'appeler par son prénom. Quel honneur ! Pourtant, vous ne montrez pas la moindre gratitude..."],
13773=>["Value"=>13773,"TextKey"=>"剧情ID2050201","TextValue"=>"<line-height=130%>Oh mon Dieu, c'est quoi ça ?"],
13774=>["Value"=>13774,"TextKey"=>"剧情ID2050202","TextValue"=>"<line-height=130%>C'est une rivière souterraine ! Je ne peux pas croire que notre équipe ait réussi à trouver une <color=#f58c26>Rivière souterraine</color> ! Maintenant on a de l'eau !"],
13775=>["Value"=>13775,"TextKey"=>"剧情ID2050203","TextValue"=>"<line-height=130%>Me voilà trempé."],
13776=>["Value"=>13776,"TextKey"=>"剧情ID2050204","TextValue"=>"<line-height=130%>Eh bien, sois courageux, mauviette ! C'est juste un peu d'eau ! "],
13777=>["Value"=>13777,"TextKey"=>"剧情ID2050205","TextValue"=>"Hé Chef, maintenant que vous avez de l'eau, nous pouvons faire pousser des Plantes succulentes ! Une feuille de plante succulente, un peu de chant et des soins appropriés et vous obtiendrez une plante succulente en un rien de temps !"],
13778=>["Value"=>13778,"TextKey"=>"剧情ID2050206","TextValue"=>"<line-height=130%>Ces dames sont à vos ordres, allez leur demander de chercher des seaux, des pelles et de l'engrais. Je vais attendre ici."],
13779=>["Value"=>13779,"TextKey"=>"剧情ID2060101","TextValue"=>"<line-height=130%>C'est bon ! C'est fait, regardez comme c'est mignon ! Prenez-en un morceau, un gros."],
13780=>["Value"=>13780,"TextKey"=>"剧情ID2060102","TextValue"=>"<line-height=130%>Je n'ai jamais vu ce type de plantes auparavant... Quoi ? Prendre un morceau, vous dites ?"],
13781=>["Value"=>13781,"TextKey"=>"剧情ID2060103","TextValue"=>"<line-height=130%>Oui, prenez-en une feuille, pressez-en le jus et frottez-la sur votre peau blessée."],
13782=>["Value"=>13782,"TextKey"=>"剧情ID2060104","TextValue"=>"<line-height=130%>Ok... Prendre un morceau... Frotter... Wouah, ça a vraiment marché ! Je n'ai jamais entendu parler d'herbes qui peuvent guérir les blessures aussi vite !"],
13783=>["Value"=>13783,"TextKey"=>"剧情ID2060105","TextValue"=>"Les gens m'appellent la mère de toutes les terres, je dis juste. Je suppose que ce surnom me vient de mon impressionnante main verte. Ce ne sont pas des Plantes succulentes ordinaires. Je les ai fait pousser moi-même."],
13784=>["Value"=>13784,"TextKey"=>"剧情ID2060106","TextValue"=>"<line-height=130%>Un travailleur miracle ! Ah ! Maintenant je sens que nous pouvons résoudre le mystère de notre patrie en un rien de temps ! "],
13785=>["Value"=>13785,"TextKey"=>"剧情ID2060107","TextValue"=>"En fait, à ce propos, j'ai vraiment besoin de faire une sieste maintenant que je n'ai plus d'énergie. Ça vous dérange si je vais me reposer dans votre Maison ? C'est un Camp de base ? Vous avez un lit ?"],
13786=>["Value"=>13786,"TextKey"=>"剧情ID2060108","TextValue"=>"Oui, c'est un genre de Camp de base et voici la carte que nous avons faite pour y retourner. Mais... vous avez prévu de simplement passer la nuit, ou bien comptez-vous vous joindre à nous ?"],
13787=>["Value"=>13787,"TextKey"=>"剧情ID2060109","TextValue"=>"<line-height=130%>Bien sûr que je me joins à vous ! Êtes-vous stupide ? ! Vous avez besoin d'aide et je n'ai rien d'autre à faire, alors pourquoi pas ? Nous recherchons probablement la même personne de toute façon. Alors ! Je vais prendre cette carte, à plus !"],
13788=>["Value"=>13788,"TextKey"=>"剧情ID2060201","TextValue"=>"Et la voilà partie. J'ai le sentiment qu'elle sera une grande amie de notre peuple. Finissons donc de construire notre Campement. Tout comme notre ancien Camp, nous allons avoir besoin d'un <color=#f58c26>Entrepôt</color> pour stocker les matériaux."],
13789=>["Value"=>13789,"TextKey"=>"剧情ID2060202","TextValue"=>"<line-height=130%>Allons chercher des matériaux pour l'<color=#f58c26>Entrepôt</color> !"],
13790=>["Value"=>13790,"TextKey"=>"剧情ID2070101","TextValue"=>"<line-height=130%>Beau travail ! "],
13791=>["Value"=>13791,"TextKey"=>"剧情ID2070102","TextValue"=>"<line-height=130%>Vous ne m'avez pas encore remercié de vous avoir conduit à la rivière ! Je vous avais bien dit que je ne m'étais pas trompée sur cet endroit !"],
13792=>["Value"=>13792,"TextKey"=>"剧情ID2070103","TextValue"=>"<line-height=130%>Très bien, très bien. Je respecterai pleinement votre divination à l'avenir et je satisferai chacune de vos demandes déraisonnables. Maintenant, de quoi avez-vous besoin pour la suite ?"],
13793=>["Value"=>13793,"TextKey"=>"剧情ID2070104","TextValue"=>"<line-height=130%>Vous... ! Oubliez ça. J'ai besoin de parler à nouveau à la Déesse pour savoir où nous devons aller ensuite. Cette fois, j'ai besoin d'une <color=#f58c26>Tour de garde</color> pour essayer l'Astrologie. "],
13794=>["Value"=>13794,"TextKey"=>"剧情ID2070105","TextValue"=>"<line-height=130%>Pourquoi l'Astrologie ? Nous ne sommes même pas sûrs de ce que sont ces étoiles, je veux dire, ce ne sont que des points lumineux dans le ciel !"],
13795=>["Value"=>13795,"TextKey"=>"剧情ID2070106","TextValue"=>"<line-height=130%>Nous n'avons plus de temps ! Nous avons des tonnes de travail à faire ! Arrêtez avec vos bêtises !"],
13796=>["Value"=>13796,"TextKey"=>"剧情ID2070107","TextValue"=>"<line-height=130%>Allez chercher ce dont nous avons besoin et revenez dès que possible !"],
13797=>["Value"=>13797,"TextKey"=>"剧情ID2070108","TextValue"=>"<line-height=130%>Très bien, alors..."],
13798=>["Value"=>13798,"TextKey"=>"剧情ID2070201","TextValue"=>"<line-height=130%>Les adultes m'ont dit de ne pas embêter les doyens, pourquoi je ne les ai pas écoutés..."],
13799=>["Value"=>13799,"TextKey"=>"剧情ID2080101","TextValue"=>"<line-height=130%>Ok mon chef, vous avez terminé votre travail. La seule chose qui reste à faire maintenant est de bâtir la <color=#f58c26>Tour de garde</color> exigée par la prêtresse..."],
13800=>["Value"=>13800,"TextKey"=>"剧情ID2080102","TextValue"=>"<line-height=130%>Je t'entends, espèce de minable ! Arrête de te plaindre et fais ton travail !"],
13801=>["Value"=>13801,"TextKey"=>"剧情ID2080103","TextValue"=>"<line-height=130%>Ok~ok~*Soupirs*"],
13802=>["Value"=>13802,"TextKey"=>"剧情ID2080201","TextValue"=>"<line-height=130%>Ok chef, je vais aller parler aux dieux."],
13803=>["Value"=>13803,"TextKey"=>"剧情ID2080202","TextValue"=>"<line-height=130%>Vous pouvez vous détendre un peu, à tout à l'heure."],
13804=>["Value"=>13804,"TextKey"=>"剧情ID2080203","TextValue"=>"<line-height=130%>*Chuchote* Par ici, chef, par ici..."],
13805=>["Value"=>13805,"TextKey"=>"剧情ID2080204","TextValue"=>"<line-height=130%>Edna peut enfin s'arrêter un moment."],
13806=>["Value"=>13806,"TextKey"=>"剧情ID2080205","TextValue"=>"<line-height=130%>Notre équipe a trouvé un tas d'or et de minerais de fer au fond de la mine."],
13807=>["Value"=>13807,"TextKey"=>"剧情ID2080206","TextValue"=>"<line-height=130%>Nous envisageons de fabriquer un coffre pour les transporter jusqu'ici et nous demandons donc votre aide."],
13808=>["Value"=>13808,"TextKey"=>"剧情ID2080207","TextValue"=>"<line-height=130%>Ça vous dirait de rassembler des matériaux pour fabriquer ce coffre ?"],
13809=>["Value"=>13809,"TextKey"=>"剧情ID2090101","TextValue"=>"<line-height=130%>Hou la ! Ça fait beaucoup d'or. "],
13810=>["Value"=>13810,"TextKey"=>"剧情ID2090102","TextValue"=>"<line-height=130%>C'est quoi, ce truc qui brille ?"],
13811=>["Value"=>13811,"TextKey"=>"剧情ID2090201","TextValue"=>"<line-height=130%>C'est un petit paquet... sur lequel il est écrit « mangez-moi ». Et à l'intérieur, une <color=#f58c26>Graine incandescente</color> ? Est-ce que ça veut dire qu'il faut... manger la graine ?"],
13812=>["Value"=>13812,"TextKey"=>"剧情ID2090202","TextValue"=>"<line-height=130%>Laissez-moi faire !"],
13813=>["Value"=>13813,"TextKey"=>"剧情ID2090203","TextValue"=>"<line-height=130%>Quoi ?! Prêtresse, qu'est-ce que vous faites ?!"],
13814=>["Value"=>13814,"TextKey"=>"剧情ID2090301","TextValue"=>"<line-height=130%>Vous venez de la manger ?! On ne sait même pas ce que c'est !"],
13815=>["Value"=>13815,"TextKey"=>"剧情ID2090302","TextValue"=>"La configuration des étoiles s'est alignée pour pointer vers le <color=#f58c26>Grand canyon</color> au <color=#f58c26>Sud-est</color> et la <color=#f58c26>graine sédative</color> m'aidera à rencontrer la Grande... ZzZ, ZzZ..."],
13816=>["Value"=>13816,"TextKey"=>"剧情ID2090303","TextValue"=>"<line-height=130%>Prêtresse ? Prêtresse ? Vous êtes toujours là ?"],
13817=>["Value"=>13817,"TextKey"=>"剧情ID2090304","TextValue"=>"<line-height=130%>ZzZ, ZzZ..."],
13818=>["Value"=>13818,"TextKey"=>"剧情ID2090305","TextValue"=>"<line-height=130%>Et elle s'est endormie. Je n'arrive pas à comprendre ces gens aux pouvoirs mystérieux. Ils semblent si étranges parfois. "],
13819=>["Value"=>13819,"TextKey"=>"剧情ID2090306","TextValue"=>"<line-height=130%>Urrrh, où devrions-nous aller maintenant que la prêtresse s'est évanouie ?"],
13820=>["Value"=>13820,"TextKey"=>"剧情ID2090307","TextValue"=>"<line-height=130%>Elle a bien dit le <color=#f58c26>Grand canyon</color> ? Au <color=#f58c26>sud-est</color> ?"],
13821=>["Value"=>13821,"TextKey"=>"剧情ID2090308","TextValue"=>"<line-height=130%>Devrait-on lui faire confiance ? Elle semble un peu... étrange en ce moment ?"],
13822=>["Value"=>13822,"TextKey"=>"剧情ID2090309","TextValue"=>"Oui, j'ai promis de lui faire confiance à l'avenir. D'ailleurs, où peut-on aller ensuite ? Reposons-nous pour aujourd'hui et dirigeons-nous vers le sud-est demain."],
13823=>["Value"=>13823,"TextKey"=>"剧情ID3010101","TextValue"=>"<line-height=130%>Hé, toi !"],
13824=>["Value"=>13824,"TextKey"=>"剧情ID3010102","TextValue"=>"Moi ?"],
13825=>["Value"=>13825,"TextKey"=>"剧情ID3010103","TextValue"=>"Oui ! Toi. Cela te dérangerait-il de donner un coup de main à une vieille dame ?"],
13826=>["Value"=>13826,"TextKey"=>"剧情ID3010104","TextValue"=>"Uh... Je ne suis pas vraiment là."],
13827=>["Value"=>13827,"TextKey"=>"剧情ID3010105","TextValue"=>"Euh, et pourquoi ça ?"],
13828=>["Value"=>13828,"TextKey"=>"剧情ID3010106","TextValue"=>"Je suis avec les gens de ma tribu en ce moment. Nous sommes en voyage à la recherche de héros qui peuvent nous aider à résoudre le mystère de notre patrie."],
13829=>["Value"=>13829,"TextKey"=>"剧情ID3010107","TextValue"=>"Je vois. En fait, je te parlais à toi, celui qui tient cette petite plaque lumineuse."],
13830=>["Value"=>13830,"TextKey"=>"剧情ID3010108","TextValue"=>"Mon... <color=#f58c26>téléphone</color> ?"],
13831=>["Value"=>13831,"TextKey"=>"剧情ID3010109","TextValue"=>"Oui, exactement. Ce <color=#f58c26>« montéléphone »</color>. Peux-tu m'aider ?"],
13832=>["Value"=>13832,"TextKey"=>"剧情ID3010110","TextValue"=>"Un instant... Comment arrivez-vous à me snifff ?"],
13833=>["Value"=>13833,"TextKey"=>"剧情ID3010111","TextValue"=>"Oh ma chérie, bien que j'aie un œil aveugle, j'arrive quand même à tout sentir. Tu comprendras plus tard. À présent, tu veux bien m'aider ?"],
13834=>["Value"=>13834,"TextKey"=>"剧情ID3010112","TextValue"=>"Ok. De quoi avez-vous besoin ?"],
13835=>["Value"=>13835,"TextKey"=>"剧情ID3010113","TextValue"=>"Ta tribu va bientôt passer par ici, n'est-ce pas ? Je fais semblant d'avoir désespérément besoin de nourriture, j'installe un <color=#f58c26>Petit stand</color> pour vendre mes produits ? Diantre, quel plan merveilleux !"],
13836=>["Value"=>13836,"TextKey"=>"剧情ID3010114","TextValue"=>"Je ne comprends pas..."],
13837=>["Value"=>13837,"TextKey"=>"剧情ID3010115","TextValue"=>"Je n'ai pas envie d'aider n'importe quel rustre sans coeur, n'est-ce pas ? Pour mériter mon aide, il va falloir la mériter !"],
13838=>["Value"=>13838,"TextKey"=>"剧情ID3010116","TextValue"=>"Alors ?"],
13839=>["Value"=>13839,"TextKey"=>"剧情ID3010117","TextValue"=>"S'ils achètent mes produits et me donnent de la nourriture, ils en seront dignes. S'ils m'offrent directement de la nourriture, c'est encore mieux !"],
13840=>["Value"=>13840,"TextKey"=>"剧情ID3010118","TextValue"=>"Sinon ? Un claquement de doigts et ta tribu disparaîtra. Compris ? Alors va me chercher des matériaux !"],
13841=>["Value"=>13841,"TextKey"=>"剧情ID3020101","TextValue"=>"Incroyable ! Grand merci à vous tous ! "],
13842=>["Value"=>13842,"TextKey"=>"剧情ID3020102","TextValue"=>"J'espère que ma fille sera aussi fiable et efficace que toi. "],
13843=>["Value"=>13843,"TextKey"=>"剧情ID3020103","TextValue"=>"Nous avons été séparées plus tôt dans le désert et je me suis perdue... Mon sens de l'orientation n'est pas terrible. "],
13844=>["Value"=>13844,"TextKey"=>"剧情ID3020104","TextValue"=>"Savez-vous où elle se trouve maintenant ?"],
13845=>["Value"=>13845,"TextKey"=>"剧情ID3020105","TextValue"=>"Bien sûre que je sais où elle se trouve ! Mais elle ne peut pas simplement... ne pas me chercher ! "],
13846=>["Value"=>13846,"TextKey"=>"剧情ID3020201","TextValue"=>"Ça fait du bien. Tu sais ? Juste toi et moi, en train de nous détendre, de bavarder un peu, de faire des commérages..."],
13847=>["Value"=>13847,"TextKey"=>"剧情ID3020301","TextValue"=>"Ils sont en chemin. Il nous suffit d'attendre."],
13848=>["Value"=>13848,"TextKey"=>"剧情ID3020302","TextValue"=>"..."],
13849=>["Value"=>13849,"TextKey"=>"剧情ID3020303","TextValue"=>"Un long moment s'est écoulé."],
13850=>["Value"=>13850,"TextKey"=>"剧情ID3020304","TextValue"=>"Je vais aller escalader ces os et voir où ils se trouvent."],
13851=>["Value"=>13851,"TextKey"=>"剧情ID3020401","TextValue"=>"Ha ! Ils sont carrément là ! Ta petite prêtresse est irrésistiblement mignonne !"],
13852=>["Value"=>13852,"TextKey"=>"剧情ID3020402","TextValue"=>"Très bien, ils seront là en un rien de temps. J'ai hâte de rencontrer ton peuple ! Maintenant, il ne me reste plus qu'à descendre prudemment...."],
13853=>["Value"=>13853,"TextKey"=>"剧情ID3020501","TextValue"=>"Vous allez bien ?"],
13854=>["Value"=>13854,"TextKey"=>"剧情ID3020502","TextValue"=>"Bonjour ?"],
13855=>["Value"=>13855,"TextKey"=>"剧情ID3020601","TextValue"=>"Peu après"],
13856=>["Value"=>13856,"TextKey"=>"剧情ID3020701","TextValue"=>"« « J'ai faim. Achetez mes produits. Donnez à manger ». Euh... On dirait que quelqu'un a lancé un petit commerce dans le coin."],
13857=>["Value"=>13857,"TextKey"=>"剧情ID3020702","TextValue"=>"Ah Chef, vous êtes là. La Prêtresse Edna a dit que quelqu'un de son rêve nous attend ici. "],
13858=>["Value"=>13858,"TextKey"=>"剧情ID3020703","TextValue"=>"Je vois quelques traces d'activité humaine par ici, ce feu de camp s'est éteint, ce petit stand est sur le point de s'effondrer et je ne vois personne dans les environs... On nous a posé un lapin ?"],
13859=>["Value"=>13859,"TextKey"=>"剧情ID3020704","TextValue"=>"Bref, construisons un Camp et passons la nuit ici, en attendant que cette « personne du rêve » se montre."],
13860=>["Value"=>13860,"TextKey"=>"剧情ID3020801","TextValue"=>"Je suis tellement épuisée... Enfin... cette cape est un véritable four ! Je suis en train de rôtir ! Enlevez-la !"],
13861=>["Value"=>13861,"TextKey"=>"剧情ID3020802","TextValue"=>"Chère prêtresse, vous dormiez à poings fermés sur le dos d'un chameau tout à l'heure. Vous n'avez pas le droit de dire que vous êtes épuisée."],
13862=>["Value"=>13862,"TextKey"=>"剧情ID3020803","TextValue"=>"Au fait, vous ne pouvez pas non plus enlever votre cape. Même s'il fait aussi chaud qu'en enfer en ce moment, il fait toujours aussi froid la nuit."],
13863=>["Value"=>13863,"TextKey"=>"剧情ID3020804","TextValue"=>"Mon Dieu... Pourquoi m'avoir fait venir ici... et devoir en plus supporter ce jeune homme arrogant..."],
13864=>["Value"=>13864,"TextKey"=>"剧情ID3020805","TextValue"=>"S'il vous plaît, soyez un peu plus indulgente. Le Chef rassemblera les matériaux dont nous avons besoin pour construire une <color=#f58c26>Tente</color> ici."],
13865=>["Value"=>13865,"TextKey"=>"剧情ID3030101","TextValue"=>"Bien joué Chef ! Au travail !"],
13866=>["Value"=>13866,"TextKey"=>"剧情ID3030201","TextValue"=>"Super ! Je crois que les gens ont tous faim maintenant. Profitons pleinement de ce feu de camp et concoctons quelque chose. Bien manger pour bien travailler !"],
13867=>["Value"=>13867,"TextKey"=>"剧情ID3030202","TextValue"=>"Hourra ! À manger ! Du bacon !"],
13868=>["Value"=>13868,"TextKey"=>"剧情ID3030203","TextValue"=>"Des côtelettes d'agneau pour moi s'il vous plaît..."],
13869=>["Value"=>13869,"TextKey"=>"剧情ID3030204","TextValue"=>"Espèce de carnivore sauvage !"],
13870=>["Value"=>13870,"TextKey"=>"剧情ID3030205","TextValue"=>"Alors, que voulez-vous ?"],
13871=>["Value"=>13871,"TextKey"=>"剧情ID3030206","TextValue"=>"Un steak, rosé avec sauce au raifort s'il vous plaît."],
13872=>["Value"=>13872,"TextKey"=>"剧情ID3030207","TextValue"=>"Prêtresse, c'est aussi..."],
13873=>["Value"=>13873,"TextKey"=>"剧情ID3030208","TextValue"=>"Je sais ! Chut !"],
13874=>["Value"=>13874,"TextKey"=>"剧情ID3030209","TextValue"=>"Haha, les protéines sont très importantes pour un corps mobile. Le voyage a été difficile, alors festoyons ! Qu'est-ce que vous en dites, Chef ?"],
13875=>["Value"=>13875,"TextKey"=>"剧情ID3030210","TextValue"=>"Nous n'avons pas beaucoup de matériaux pour cuisiner..."],
13876=>["Value"=>13876,"TextKey"=>"剧情ID3030211","TextValue"=>"Nous avons du mouton, du bœuf séché et des pommes, Chef !"],
13877=>["Value"=>13877,"TextKey"=>"剧情ID3030212","TextValue"=>"Mais le chef a raison, on veut quand même en garder un peu pour les nuits plus rudes plus tard. Il nous faut donc trouver des protéines alternatives."],
13878=>["Value"=>13878,"TextKey"=>"剧情ID3030213","TextValue"=>"J'ai aperçu des lézards du désert. Les œufs de lézards et les lézards sont d'excellentes sources de protéines !"],
13879=>["Value"=>13879,"TextKey"=>"剧情ID3030214","TextValue"=>"Qu'avez-vous dit ?! Des lézards ?! Comment pouvons-nous manger des lézards ?!"],
13880=>["Value"=>13880,"TextKey"=>"剧情ID3030215","TextValue"=>"Il existe toutes sortes de mets délicats que nous pouvons créer si nous ouvrons notre esprit ! Par exemple, le ragoût de lézard semble particulièrement succulent !"],
13881=>["Value"=>13881,"TextKey"=>"剧情ID3030216","TextValue"=>"J'ai hâte !"],
13882=>["Value"=>13882,"TextKey"=>"剧情ID3030217","TextValue"=>"Oh... sus au lézard..."],
13883=>["Value"=>13883,"TextKey"=>"剧情ID3040101","TextValue"=>"Incroyable ! Vous avez rassemblé tous les matériaux ! Allons-y !"],
13884=>["Value"=>13884,"TextKey"=>"剧情ID3040102","TextValue"=>"J'arrive ! Allumez le feu de camp !"],
13885=>["Value"=>13885,"TextKey"=>"剧情ID3040201","TextValue"=>"Enfin... de la nourriture... je ne peux plus bouger... œufs pochés... du steak... de la pomme au four..."],
13886=>["Value"=>13886,"TextKey"=>"剧情ID3040202","TextValue"=>"Côtelettes de mouton pour Arlan, et œufs pochés pour Kevin... Et la Prêtresse Edna va partager ce bol de délicieux ragoût de lézard avec moi..."],
13887=>["Value"=>13887,"TextKey"=>"剧情ID3040301","TextValue"=>"Personne ne veut partager le ragoût de lézard !"],
13888=>["Value"=>13888,"TextKey"=>"剧情ID3040302","TextValue"=>"Eh bien, je pense que je vais servir ce bol de ragoût chaud, fumant et délicieux à nos nouveaux amis."],
13889=>["Value"=>13889,"TextKey"=>"剧情ID3040303","TextValue"=>"De nouveaux amis ? Quels nouveaux amis ?"],
13890=>["Value"=>13890,"TextKey"=>"剧情ID3040401","TextValue"=>"Ah !!! Noooon !!!! Enlevez-moi ces rats !!!!"],
13891=>["Value"=>13891,"TextKey"=>"剧情ID3040402","TextValue"=>"Tout d'abord, ce ne sont pas des rats. Des rats ne peuvent pas être aussi gros. D'après mes observations, ce sont des gerbilles, une sorte de rongeurs vivant uniquement dans les régions arides."],
13892=>["Value"=>13892,"TextKey"=>"剧情ID3040403","TextValue"=>"En outre, ils sont étonnamment timides malgré leur taille impressionnante. Je vous assure donc que ces gentilles créatures sont totalement inoffensives envers les êtres humains."],
13893=>["Value"=>13893,"TextKey"=>"剧情ID3040404","TextValue"=>"Ok ok je sais !!! Je me fiche de ce qu'ils sont ! Faites-les partir !!"],
13894=>["Value"=>13894,"TextKey"=>"剧情ID3040405","TextValue"=>"Hmm... maintenant que vous en parlez, c'est en fait assez étrange qu'ils n'aient pas du tout peur de vous..."],
13895=>["Value"=>13895,"TextKey"=>"剧情ID3040406","TextValue"=>"Chers ouvriers, auriez-vous l'amabilité d'enlever ces charmantes créatures de notre prêtresse ?"],
13896=>["Value"=>13896,"TextKey"=>"剧情ID3040407","TextValue"=>"Oui !"],
13897=>["Value"=>13897,"TextKey"=>"剧情ID3040501","TextValue"=>"Hé ! Rendez-moi ça !"],
13898=>["Value"=>13898,"TextKey"=>"剧情ID3040502","TextValue"=>"Hmm, et les voilà partis. On dirait qu'ils ont toujours peur de tout le monde sauf de la prêtresse."],
13899=>["Value"=>13899,"TextKey"=>"剧情ID3040503","TextValue"=>"Ils ont pris ma bague ! Ma bague adorée..."],
13900=>["Value"=>13900,"TextKey"=>"剧情ID3040504","TextValue"=>"Pauvre prêtresse, je suppose que nous pouvons suivre leurs traces dans les restes du dragon ? Ces petits gars m'intriguent beaucoup, je dois dire. "],
13901=>["Value"=>13901,"TextKey"=>"剧情ID3040505","TextValue"=>"Et pour ce faire, nous avons besoin d'un <color=#f58c26>Moulin à vent</color> pour nous aider à transporter les gens vers le haut et vers le bas, compte tenu de la pente de cette montagne."],
13902=>["Value"=>13902,"TextKey"=>"剧情ID3050101","TextValue"=>"Les matériaux du <color=#f58c26>Moulin à vent</color> sont-ils déjà prêts ?! Impressionnant !"],
13903=>["Value"=>13903,"TextKey"=>"剧情ID3050102","TextValue"=>"Le Moulin à vent fraîchement construit arrive tout de suite !"],
13904=>["Value"=>13904,"TextKey"=>"剧情ID3050201","TextValue"=>"Super ! Maintenant c'est beaucoup plus sûr et pratique de monter et descendre la pente !"],
13905=>["Value"=>13905,"TextKey"=>"剧情ID3050202","TextValue"=>"Super ! Dépêche-toi de me ramener ma bague ! C'est une bague sacrée !"],
13906=>["Value"=>13906,"TextKey"=>"剧情ID3050203","TextValue"=>"Ok ok on y va ! Kevin, Arlan, vous êtes prêts ?"],
13907=>["Value"=>13907,"TextKey"=>"剧情ID3050204","TextValue"=>"Comme toujours !"],
13908=>["Value"=>13908,"TextKey"=>"剧情ID3050205","TextValue"=>"Euh... Chef... non pas que je sois un lâche, mais je pense que nous allons avoir besoin de cordes juste au cas où nous tomberions de la falaise..."],
13909=>["Value"=>13909,"TextKey"=>"剧情ID3050206","TextValue"=>"Aha, vous avez tout à fait raison ! La sécurité au travail est importante ! Alors Chef, allez chercher des équipements de sécurité !"],
13910=>["Value"=>13910,"TextKey"=>"剧情ID3060101","TextValue"=>"Sommes-nous prêts à présent ?"],
13911=>["Value"=>13911,"TextKey"=>"剧情ID3060102","TextValue"=>"Oui !"],
13912=>["Value"=>13912,"TextKey"=>"剧情ID3060103","TextValue"=>"Magnifique ! Allons résoudre le mystère de ces gerbilles sur-le-champ ! Comme c'est excitant !"],
13913=>["Value"=>13913,"TextKey"=>"剧情ID3060104","TextValue"=>"Et récupérez ma bague !"],
13914=>["Value"=>13914,"TextKey"=>"剧情ID3060201","TextValue"=>"Waouh, c'est un tas d'os vraiment profond ! Un instant... il y a un truc qui brille au fond... Hmm... ça peut être la bague d'Edna ?"],
13915=>["Value"=>13915,"TextKey"=>"剧情ID3060202","TextValue"=>"Chef ! Regardez ce qu'on a trouvé ! Une vieille femme couverte de crasse !"],
13916=>["Value"=>13916,"TextKey"=>"剧情ID3060203","TextValue"=>"Et la bague de la Prêtresse."],
13917=>["Value"=>13917,"TextKey"=>"剧情ID3060301","TextValue"=>"*Les larmes aux yeux* Merci, Arlan, le plus sensé de nous tous... Un instant... quoi ?"],
13918=>["Value"=>13918,"TextKey"=>"剧情ID3060401","TextValue"=>"*Couinements excités*"],
13919=>["Value"=>13919,"TextKey"=>"剧情ID3060402","TextValue"=>"J'imagine que... merci ?"],
13920=>["Value"=>13920,"TextKey"=>"剧情ID3060403","TextValue"=>"*Bruits de joie*"],
13921=>["Value"=>13921,"TextKey"=>"剧情ID3060501","TextValue"=>"*Couinements excités*"],
13922=>["Value"=>13922,"TextKey"=>"剧情ID3060502","TextValue"=>"Oh, salut ! Bonjour ! Tu es si accueillante ! Est-ce qu'on se connaît ? Ta fourrure me semble plutôt familière..."],
13923=>["Value"=>13923,"TextKey"=>"剧情ID3060503","TextValue"=>"Oh ! Et tu dois être cette petite prêtresse que j'ai vue en rêve ! Tu es encore plus mignonne dans la vraie vie !"],
13924=>["Value"=>13924,"TextKey"=>"剧情ID3060504","TextValue"=>"Petite ? Comment osez-vous me traiter de petite ?! Je suis la noble messagère de Dieu..."],
13925=>["Value"=>13925,"TextKey"=>"剧情ID3060505","TextValue"=>"Excusez-moi, vous avez dit que vous aviez rêvé de notre prêtresse ?"],
13926=>["Value"=>13926,"TextKey"=>"剧情ID3060506","TextValue"=>"Oh~ Jeune homme ! Oui ! J'ai rêvé que je lui disais que je l'attendais. Mais je ne sais pas du tout ce que cela signifie !"],
13927=>["Value"=>13927,"TextKey"=>"剧情ID3060507","TextValue"=>"Que voulez-vous dire par vous ne savez pas ce que ça veut dire ?!"],
13928=>["Value"=>13928,"TextKey"=>"剧情ID3060508","TextValue"=>"À vrai dire, c'est assez bizarre. Je ne me souviens pas du tout de comment je m'appelle, alors je ne sais pas ce que signifie ce rêve étrange. "],
13929=>["Value"=>13929,"TextKey"=>"剧情ID3060509","TextValue"=>"J'ai dû me cogner la tête violemment en tombant dans la fosse. Je suis encore un peu chancelante quand je marche. Voyez-vous ?"],
13930=>["Value"=>13930,"TextKey"=>"剧情ID3060510","TextValue"=>"Ce petit stand là-bas, c'est le vôtre ? Il est écrit « J'ai faim. Acheter mes produits. Donnez à manger »."],
13931=>["Value"=>13931,"TextKey"=>"剧情ID3060511","TextValue"=>"Étant donné que ce qui est écrit sur ce stand me décrit exactement, et que nous sommes au milieu d'un désert, oui, je suppose que c'est le mien."],
13932=>["Value"=>13932,"TextKey"=>"剧情ID3060512","TextValue"=>"Oh ! Pas d'inquiétude ! Nous avons de la nourriture en abondance. Venez dans notre tente pour vous rassasier."],
13933=>["Value"=>13933,"TextKey"=>"剧情ID3060513","TextValue"=>"Ce serait formidable !"],
13934=>["Value"=>13934,"TextKey"=>"剧情ID3060514","TextValue"=>"Oh, une chose cependant, je sens le bacon, la pomme au four, et... <color=#f58c26>une tempête imminente</color> dans l'air. Vous feriez mieux de vous préparer. "],
13935=>["Value"=>13935,"TextKey"=>"剧情ID3060601","TextValue"=>"Et... la voilà partie. Très bien alors, Chef, je suis sûr que vous avez entendu, le vent est fort et fou par ici, laissez-moi voir...."],
13936=>["Value"=>13936,"TextKey"=>"剧情ID3060602","TextValue"=>"Notre tente a besoin d'être renforcée au sommet pour l'alourdir."],
13937=>["Value"=>13937,"TextKey"=>"剧情ID3060603","TextValue"=>"Pourquoi doit-on l'écouter ! Nous ne savons même pas d'où elle sort et vous croyez tout ce qu'elle dit ! "],
13938=>["Value"=>13938,"TextKey"=>"剧情ID3060604","TextValue"=>"Mes prédictions... vous trouvez toujours une erreur et vous vous moquez de moi encore et encore ! Je vais découvrir les vraies intentions de cette femme. Vous allez voir ce que vous allez voir !"],
13939=>["Value"=>13939,"TextKey"=>"剧情ID3060605","TextValue"=>"Ooooh, quelqu'un veut rivaliser. Quoi qu'il en soit, Chef, j'ai fait la liste des matériaux nécessaires pour <color=#f58c26>renforcer la tente</color>, jetez-y un coup d'oeil."],
13940=>["Value"=>13940,"TextKey"=>"剧情ID3070101","TextValue"=>"Hmm, délicieux thé."],
13941=>["Value"=>13941,"TextKey"=>"剧情ID3070102","TextValue"=>"Et ce biscuit est aussi très bon, il fond dans la bouche. Bien qu'il soit un peu brûlé à l'extérieur. "],
13942=>["Value"=>13942,"TextKey"=>"剧情ID3070103","TextValue"=>"Vous devrez baisser la température la prochaine fois et le faire cuire plus longtemps."],
13943=>["Value"=>13943,"TextKey"=>"剧情ID3070104","TextValue"=>"Pourquoi prend-elle le goûter ?!"],
13944=>["Value"=>13944,"TextKey"=>"剧情ID3070105","TextValue"=>"Qu'est-ce qu'il y a ?"],
13945=>["Value"=>13945,"TextKey"=>"剧情ID3070106","TextValue"=>"Et qu'est-ce que c'est que cet étrange accent britannique ! Nous ne sommes même pas à la bonne époque !"],
13946=>["Value"=>13946,"TextKey"=>"剧情ID3070107","TextValue"=>"Détends-toi, petite prêtresse. Tout va bien se passer. Tu vas comprendre."],
13947=>["Value"=>13947,"TextKey"=>"剧情ID3070108","TextValue"=>"Non ! Rien ne va bien se passer ! Et je ne vais rien comprendre ! Mon Dieu... D'où vient cette femme ?..."],
13948=>["Value"=>13948,"TextKey"=>"剧情ID3070109","TextValue"=>"Puisque tu me l'as demandé avec ta plus grande sincérité, en fait, grâce au goûter que je viens de déguster, je deviens légèrement nostalgique."],
13949=>["Value"=>13949,"TextKey"=>"剧情ID3070110","TextValue"=>"Je crois que j'ai retrouvé certains de mes souvenirs. En fait, je veux dire, pour dire les choses le plus honnêtement et directement..."],
13950=>["Value"=>13950,"TextKey"=>"剧情ID3070111","TextValue"=>"Qu'y a-t-il ?"],
13951=>["Value"=>13951,"TextKey"=>"剧情ID3070112","TextValue"=>"Pouvez-vous également consolider ce <color=#f58c26>Petit stand</color> à l'extérieur pour moi ?"],
13952=>["Value"=>13952,"TextKey"=>"剧情ID3070113","TextValue"=>"Quoi ?!"],
13953=>["Value"=>13953,"TextKey"=>"剧情ID3070114","TextValue"=>"Maintenant que nous spéculons que ce stand est une de mes œuvres, je suppose que je l'ai monté pour vendre certaines de mes affaires en échange de nourriture."],
13954=>["Value"=>13954,"TextKey"=>"剧情ID3070115","TextValue"=>"Moi qui ai marché seule pendant des jours, construisant ce stand en mourant de faim...Oh, une si pauvre femme !"],
13955=>["Value"=>13955,"TextKey"=>"剧情ID3070116","TextValue"=>"Quelle femme intéressante."],
13956=>["Value"=>13956,"TextKey"=>"剧情ID3070117","TextValue"=>"Pardon, qu'est-ce que tu as dit ?!"],
13957=>["Value"=>13957,"TextKey"=>"剧情ID3070118","TextValue"=>"Chef, j'ai fait la liste des matériaux pour vous, veuillez la consulter."],
13958=>["Value"=>13958,"TextKey"=>"剧情ID3070119","TextValue"=>"Ne m'ignorez pas !!!!! Mince, je n'en peux plus !"],
13959=>["Value"=>13959,"TextKey"=>"剧情ID3080101","TextValue"=>"Magnifique ! Vous êtes tous incroyables !"],
13960=>["Value"=>13960,"TextKey"=>"剧情ID3080102","TextValue"=>"Mère ! Je le savais ! Je savais que c'était toi !"],
13961=>["Value"=>13961,"TextKey"=>"剧情ID3080201","TextValue"=>"Grand Tlachtga, comment se fait-il que vous soyez ici ?!"],
13962=>["Value"=>13962,"TextKey"=>"剧情ID3080202","TextValue"=>"Et qui est cette jeune femme ?"],
13963=>["Value"=>13963,"TextKey"=>"剧情ID3080203","TextValue"=>"Tlachtga ! Ta fille ! Arrête de faire l'idiote !"],
13964=>["Value"=>13964,"TextKey"=>"剧情ID3080204","TextValue"=>"La messagère m'a dit qu'ils ont déterré une vieille femme aveugle d'un tas d'os, elle te ressemblait beaucoup, alors je suis venue vérifier."],
13965=>["Value"=>13965,"TextKey"=>"剧情ID3080205","TextValue"=>"Je ne suis pas du tout surprise de te voir ici."],
13966=>["Value"=>13966,"TextKey"=>"剧情ID3080206","TextValue"=>"La mère de Tlachtga... Je ne savais pas que Tlachtga avait une mère..."],
13967=>["Value"=>13967,"TextKey"=>"剧情ID3080207","TextValue"=>"Bien sûr que j'ai une mère, abruti !"],
13968=>["Value"=>13968,"TextKey"=>"剧情ID3080208","TextValue"=>"Surveille ton langage."],
13969=>["Value"=>13969,"TextKey"=>"剧情ID3080209","TextValue"=>"Peu importe, cette folle là-bas est Mug Ruith, qui se tient juste en face de vous."],
13970=>["Value"=>13970,"TextKey"=>"剧情ID3080210","TextValue"=>"Appelez-moi Meg."],
13971=>["Value"=>13971,"TextKey"=>"剧情ID3080211","TextValue"=>"Mais je croyais que Mug Ruith était un homme..."],
13972=>["Value"=>13972,"TextKey"=>"剧情ID3080212","TextValue"=>"Eh bien, ma mère peut être bien des choses dans les contes. Elle a caché sa véritable identité aux gens quand j'étais petite."],
13973=>["Value"=>13973,"TextKey"=>"剧情ID3080213","TextValue"=>"Car vous savez, qui est plus susceptible d'être exploité qu'une femme aveugle et un enfant de trois ans ?"],
13974=>["Value"=>13974,"TextKey"=>"剧情ID3080214","TextValue"=>"Je suppose que c'est ainsi que l'histoire a commencé à se répandre... un druide omnipotent qui sait tout, un guerrier aveugle, un puissant chevalier..."],
13975=>["Value"=>13975,"TextKey"=>"剧情ID3080215","TextValue"=>"Alors qu'en fait, elle n'est rien d'autre qu'une vieille femme aveugle avec un sens de l'humour particulier."],
13976=>["Value"=>13976,"TextKey"=>"剧情ID3080216","TextValue"=>"Mug Ruith est une femme... et j'ai été impoli envers Mug Ruith... Oh... je suis maudite... je ne mérite pas mon titre de prêtresse..."],
13977=>["Value"=>13977,"TextKey"=>"剧情ID3080217","TextValue"=>"Petite prêtresse, ne sois pas si morose. Tu vas t'améliorer en matière de gentillesse~ Je te pardonne cette fois-ci puisque tu es si mignonne !~"],
13978=>["Value"=>13978,"TextKey"=>"剧情ID3080218","TextValue"=>"Vous nous avez donc trompés ? Vous n'avez pas perdu la mémoire ?"],
13979=>["Value"=>13979,"TextKey"=>"剧情ID3080219","TextValue"=>"Ouais... dommage. Les longs trajets peuvent être ennuyeux, vous savez ? Je voulais juste m'amuser un peu."],
13980=>["Value"=>13980,"TextKey"=>"剧情ID3080220","TextValue"=>"Mais hé, regardez cette belle tente et ce beau stand ! Maintenant, cela commence à ressembler à un Campement ! Bien que, ça manque toujours de..."],
13981=>["Value"=>13981,"TextKey"=>"剧情ID3080221","TextValue"=>"Qu'est-ce qui manque ?"],
13982=>["Value"=>13982,"TextKey"=>"剧情ID3080222","TextValue"=>"Laissez-moi voir..."],
13983=>["Value"=>13983,"TextKey"=>"剧情ID3080301","TextValue"=>"Un portail ! Vous avez besoin d'un portail pour marquer l'entrée du Camp et avec quelques lampes, il sera plus fabuleux que jamais !"],
13984=>["Value"=>13984,"TextKey"=>"剧情ID3080302","TextValue"=>"Nous serons vos plus humbles serviteurs et irons construire ce portail, madame ! Chef, ressaisissez-vous !"],
13985=>["Value"=>13985,"TextKey"=>"剧情ID3090101","TextValue"=>"Tout est prêt ? Super ! Allez-y, avancez !"],
13986=>["Value"=>13986,"TextKey"=>"剧情ID3090201","TextValue"=>"Oh ! Quel rajeunissement ! C'est la première fois que je dirige un chantier de construction...."],
13987=>["Value"=>13987,"TextKey"=>"剧情ID3090202","TextValue"=>"Félicitations, Prêtresse, vous avez tellement grandi. Mais je ne suis pas sûr que Meg soit satisfaite de l'aspect de notre Campement actuellement ?"],
13988=>["Value"=>13988,"TextKey"=>"剧情ID3090203","TextValue"=>"Tout le reste est bien, sauf le ciel vide qui semble plutôt terne...."],
13989=>["Value"=>13989,"TextKey"=>"剧情ID3090204","TextValue"=>"Je sais ! Je sais ! On a quelques ballons de signalisation qui peuvent flotter dans le ciel !"],
13990=>["Value"=>13990,"TextKey"=>"剧情ID3090205","TextValue"=>"C'est une super idée ! Il faut juste quelques petites retouches pour épicer le tout. "],
13991=>["Value"=>13991,"TextKey"=>"剧情ID3090206","TextValue"=>"Il vous restent encore quelques unes de ces roches jaunes et roses incandescentes ?"],
13992=>["Value"=>13992,"TextKey"=>"剧情ID3090207","TextValue"=>"Oui, il en reste !"],
13993=>["Value"=>13993,"TextKey"=>"剧情ID3090208","TextValue"=>"Incroyable. Donnez-moi un instant. Kevin, approche."],
13994=>["Value"=>13994,"TextKey"=>"剧情ID3090301","TextValue"=>"Ouf, c'était un sacré exercice. Mais regardez-les, ne sont-ils pas tout simplement magnifiques ?"],
13995=>["Value"=>13995,"TextKey"=>"剧情ID3090302","TextValue"=>"Oui, en effet."],
13996=>["Value"=>13996,"TextKey"=>"剧情ID3090303","TextValue"=>"Content qu'elles vous plaisent. C'est rare que mère fasse quelque chose de normal. De toute façon, il se fait tard, je vais rentrer maintenant. "],
13997=>["Value"=>13997,"TextKey"=>"剧情ID3090304","TextValue"=>"Tu pars déjà ?"],
13998=>["Value"=>13998,"TextKey"=>"剧情ID3090305","TextValue"=>"Ouais, ou quoi ? Je ne vais pas m'entasser avec vous, les hommes qui sentent mauvais, dans votre petite tente ! Mère, tu viens avec moi ?"],
13999=>["Value"=>13999,"TextKey"=>"剧情ID3090306","TextValue"=>"Je te rejoindrai plus tard. Tes nouveaux amis ont l'air charmants, surtout cette mignonne petite prêtresse~ ! J'ai envie de passer un moment avec eux~"],
14000=>["Value"=>14000,"TextKey"=>"剧情ID3090307","TextValue"=>"Mère, sois sage."],
14001=>["Value"=>14001,"TextKey"=>"剧情ID3090308","TextValue"=>"Je sais, je sais, je vais bien me comporter, t'inquiète pas. Après tout, il nous reste encore un long voyage à faire ensemble."],
14002=>["Value"=>14002,"TextKey"=>"剧情ID3090309","TextValue"=>"Très bien alors. À plus tard."],
14003=>["Value"=>14003,"TextKey"=>"剧情ID3090401","TextValue"=>"Étiez-vous en train de suggérer que vous alliez nous rejoindre à l'instant ?"],
14004=>["Value"=>14004,"TextKey"=>"剧情ID3090402","TextValue"=>"Bien sûr, pourquoi pas ! Votre aventure sera de plus en plus dangereuse. "],
14005=>["Value"=>14005,"TextKey"=>"剧情ID3090403","TextValue"=>"Il n'y a pas grand-chose que je puisse faire, mais je peux au moins vous éclairer sur ce qui vous attend."],
14006=>["Value"=>14006,"TextKey"=>"剧情ID3090404","TextValue"=>"Mais j'ai besoin que vous me montriez le chemin vers votre Patrie. Mon sens de l'orientation est... incroyablement horrible."],
14007=>["Value"=>14007,"TextKey"=>"剧情ID4010101","TextValue"=>"Aïe… Pourquoi un endroit comme celui-ci existe sur Terre ? J’ai l’impression d'être constamment en train de marcher sur des flammes..."],
14008=>["Value"=>14008,"TextKey"=>"剧情ID4010102","TextValue"=>"Impressionnant, Enda ! Tu n’avais pas dit plus de cinq mots depuis quatre heures."],
14009=>["Value"=>14009,"TextKey"=>"剧情ID4010103","TextValue"=>"Je suis… fatigué… trop chaud…."],
14010=>["Value"=>14010,"TextKey"=>"剧情ID4010104","TextValue"=>"Vous êtes une bande de petites poupées fragiles ! C’est juste un volcan. Regardez-vous, on dirait que vous allez tomber par terre !"],
14011=>["Value"=>14011,"TextKey"=>"剧情ID4010105","TextValue"=>"Madame… Vous aussi, vous transpirez à flots. Vous êtes sure que ça va ?"],
14012=>["Value"=>14012,"TextKey"=>"剧情ID4010106","TextValue"=>"Mon nom, c’est Tlachtga !... Je ne suis pas fatiguée, mais c’est vrai qu’il fait chaud ici… ce qui est bien plus dangereux qu’en mer."],
14013=>["Value"=>14013,"TextKey"=>"剧情ID4010107","TextValue"=>"On dirait que nous sommes arrivés."],
14014=>["Value"=>14014,"TextKey"=>"剧情ID4010108","TextValue"=>"Voyons voir ! Selon les instructions de la Déesse, il y aurait une mer de flammes avec des îles au dessus…"],
14015=>["Value"=>14015,"TextKey"=>"剧情ID4010109","TextValue"=>"Oui, ça doit être là !"],
14016=>["Value"=>14016,"TextKey"=>"剧情ID4010110","TextValue"=>"Mais où est Amorgen ? Amorgen aurait dû arriver et nous attendre ici. Mais je ne le vois nul part."],
14017=>["Value"=>14017,"TextKey"=>"剧情ID4010111","TextValue"=>"Je devrais construire un autel pour trouver des signes d’Amorgen, mais…"],
14018=>["Value"=>14018,"TextKey"=>"剧情ID4010201","TextValue"=>"Euh… Chef, je…."],
14019=>["Value"=>14019,"TextKey"=>"剧情ID4010202","TextValue"=>"Enda!"],
14020=>["Value"=>14020,"TextKey"=>"剧情ID4010203","TextValue"=>"Enda!"],
14021=>["Value"=>14021,"TextKey"=>"剧情ID4010204","TextValue"=>"Elle doit avoir un coup de chaleur ! Vite, construisez un abri pour qu’elle puisse se reposer !"],
14022=>["Value"=>14022,"TextKey"=>"剧情ID4020101","TextValue"=>"Chef, la construction est terminée !"],
14023=>["Value"=>14023,"TextKey"=>"剧情ID4020102","TextValue"=>"Déesse, je devrais pouvoir vivre un peu plus longtemps…"],
14024=>["Value"=>14024,"TextKey"=>"剧情ID4020103","TextValue"=>"Il fait vraiment trop chaud ! L’odeur de la mer me manque tellement…"],
14025=>["Value"=>14025,"TextKey"=>"剧情ID4020104","TextValue"=>"Ouf, notre prêtre a meilleure mine."],
14026=>["Value"=>14026,"TextKey"=>"剧情ID4020105","TextValue"=>"C’est un peu mieux, lorsqu’on a une tente pour nous protéger de cet air chaud insoutenable…"],
14027=>["Value"=>14027,"TextKey"=>"剧情ID4020106","TextValue"=>"Ouais, juste un peu."],
14028=>["Value"=>14028,"TextKey"=>"剧情ID4020107","TextValue"=>"Ô, Déesse sacrée ! Retournez-moi, pour que je puisse être cuit des deux cotés…"],
14029=>["Value"=>14029,"TextKey"=>"剧情ID4020108","TextValue"=>"C’est clair qu’on a l’impression d’être dans un fourneau, ici."],
14030=>["Value"=>14030,"TextKey"=>"剧情ID4020109","TextValue"=>"Regardez ! Les basses terres, là-bas !"],
14031=>["Value"=>14031,"TextKey"=>"剧情ID4020110","TextValue"=>"Et oui, les gars ! Ma mère a littéralement mis au monde un génie."],
14032=>["Value"=>14032,"TextKey"=>"剧情ID4030101","TextValue"=>"C’est génial, Tlachtga ! Il y a de l’eau ! DE L’EAU !"],
14033=>["Value"=>14033,"TextKey"=>"剧情ID4030102","TextValue"=>"Ah, je crois que notre fidèle prêtre a vu la Déesse."],
14034=>["Value"=>14034,"TextKey"=>"剧情ID4030103","TextValue"=>"Je suis revenue à la vie, et je me sens beaucoup mieux !"],
14035=>["Value"=>14035,"TextKey"=>"剧情ID4030104","TextValue"=>"C’est vrai, je vois que vous êtes plus en forme !"],
14036=>["Value"=>14036,"TextKey"=>"剧情ID4030105","TextValue"=>"Très bien, alors… toi, toi et toi, dépêchez-vous de construire un Cercle d’entraînement !"],
14037=>["Value"=>14037,"TextKey"=>"剧情ID4030106","TextValue"=>"Un Cercle d’entraînement ?"],
14038=>["Value"=>14038,"TextKey"=>"剧情ID4030107","TextValue"=>"Oui, c’est bien ça !"],
14039=>["Value"=>14039,"TextKey"=>"剧情ID4030108","TextValue"=>"Devrions-nous pas chercher Amorgen ?"],
14040=>["Value"=>14040,"TextKey"=>"剧情ID4030109","TextValue"=>"Amorgen… ce vieil homme. Je sais qu’il peut contrôler les forces de la nature sans faire le moindre effort."],
14041=>["Value"=>14041,"TextKey"=>"剧情ID4030110","TextValue"=>"Je disais, marcher jusqu’ici vous a littéralement coûté la moitié de votre vie. Comment pouvons-nous laisser tomber l’exercice physique ?"],
14042=>["Value"=>14042,"TextKey"=>"剧情ID4030111","TextValue"=>"C’est vrai qu’Enda a besoin de faire plus d’exercice."],
14043=>["Value"=>14043,"TextKey"=>"剧情ID4030112","TextValue"=>"Ferme-la !"],
14044=>["Value"=>14044,"TextKey"=>"剧情ID4030113","TextValue"=>"Selon la prophétie de ma mère, les tempêtes qui nous attendent seront plus violentes que jamais..."],
14045=>["Value"=>14045,"TextKey"=>"剧情ID4030114","TextValue"=>"La prophétie de Mug Ruith…"],
14046=>["Value"=>14046,"TextKey"=>"剧情ID4030115","TextValue"=>"Jeunes hommes !"],
14047=>["Value"=>14047,"TextKey"=>"剧情ID4030116","TextValue"=>"Compris !"],
14048=>["Value"=>14048,"TextKey"=>"剧情ID4040101","TextValue"=>"Regardez le haut plateau au nord ! Tiens, il y a une échelle naturelle."],
14049=>["Value"=>14049,"TextKey"=>"剧情ID4040102","TextValue"=>"Oui, chef !"],
14050=>["Value"=>14050,"TextKey"=>"剧情ID4040103","TextValue"=>"Avez-vous remarqué la colonne au milieu ? Ça, ça ne peut pas être naturel. "],
14051=>["Value"=>14051,"TextKey"=>"剧情ID4040104","TextValue"=>"Vu la taille et la forme… Je parie ma réputation familiale de prêtre que c’est un autel de l’ancien temps !"],
14052=>["Value"=>14052,"TextKey"=>"剧情ID4040105","TextValue"=>"L’autel a l’air désert."],
14053=>["Value"=>14053,"TextKey"=>"剧情ID4040106","TextValue"=>"Effectivement, il doit être très vieux."],
14054=>["Value"=>14054,"TextKey"=>"剧情ID4040107","TextValue"=>"Un autel de ce genre, ne pouvant pas résonner avec le pouvoir de l’Archidruide, ne peux pas nous aider à trouver Amorgen."],
14055=>["Value"=>14055,"TextKey"=>"剧情ID4040108","TextValue"=>"Chef, nous avons besoin d’un appareil qui peut condenser l’énergie..."],
14056=>["Value"=>14056,"TextKey"=>"剧情ID4040109","TextValue"=>"Les matériaux doivent être capables de résister aux hautes températures, et la forme doit être tournée vers l’intérieur."],
14057=>["Value"=>14057,"TextKey"=>"剧情ID4040110","TextValue"=>"Et ces crocs étranges à côté de la lave ?"],
14058=>["Value"=>14058,"TextKey"=>"剧情ID4040111","TextValue"=>"Pas mal, Arlan ! Ce n’est pas surprenant que la Déesse ait dit « Toujours rester aux côtés de ses compagnons » !"],
14059=>["Value"=>14059,"TextKey"=>"剧情ID4040112","TextValue"=>"Carrément ! Merci, Déesse !"],
14060=>["Value"=>14060,"TextKey"=>"剧情ID4040113","TextValue"=>"Tais-toi ! Je ne parlais pas de toi !"],
14061=>["Value"=>14061,"TextKey"=>"剧情ID4040114","TextValue"=>"Donnons tous les matériaux à notre super chef !"],
14062=>["Value"=>14062,"TextKey"=>"剧情ID4050101","TextValue"=>"Chef, nous avançons à grand pas."],
14063=>["Value"=>14063,"TextKey"=>"剧情ID4050102","TextValue"=>"L’autel devrait pouvoir être utilisé !"],
14064=>["Value"=>14064,"TextKey"=>"剧情ID4050103","TextValue"=>"Mais regardez le ciel lugubre ! Enda a du mal à monter et à descendre les escaliers de l’autel. Et si elle tombait ?"],
14065=>["Value"=>14065,"TextKey"=>"剧情ID4050104","TextValue"=>"Pas mal, truc…stan. Comme quoi, parfois, tu n’es pas si lourd que ça."],
14066=>["Value"=>14066,"TextKey"=>"剧情ID4050105","TextValue"=>"Après tout, Enda est vieille… Euhhh… Je veux dire, elle n’est plus toute jeune."],
14067=>["Value"=>14067,"TextKey"=>"剧情ID4050106","TextValue"=>"Pourquoi est-ce que tu me gonfles comme ça ?"],
14068=>["Value"=>14068,"TextKey"=>"剧情ID4050107","TextValue"=>"Construisons des flambeaux de chaque côté de l’escalier. C’est vraiment simple !"],
14069=>["Value"=>14069,"TextKey"=>"剧情ID4060101","TextValue"=>"J’ai l’impression que cet autel… manque toujours de quelque chose, car je ne peux pas ressentir la présence de la Déesse..."],
14070=>["Value"=>14070,"TextKey"=>"剧情ID4060102","TextValue"=>"Mais ça devrait être assez pour ressentir celle d’Amergon !"],
14071=>["Value"=>14071,"TextKey"=>"剧情ID4060103","TextValue"=>"C’est froid… Argh… Qui est là ?"],
14072=>["Value"=>14072,"TextKey"=>"剧情ID4060104","TextValue"=>"Amorgen, où est-tu ?"],
14073=>["Value"=>14073,"TextKey"=>"剧情ID4060105","TextValue"=>"E-Es-tu Enda ? Je n’ai pas la moindre idée d’où je suis… Mais il fait si froid ici…"],
14074=>["Value"=>14074,"TextKey"=>"剧情ID4060106","TextValue"=>"Froid ?"],
14075=>["Value"=>14075,"TextKey"=>"剧情ID4060107","TextValue"=>"On dirait qu’il n’est pas là."],
14076=>["Value"=>14076,"TextKey"=>"剧情ID4060108","TextValue"=>"Je ne peux pas bouger… À l’aide, $#^*,!@%&:?"],
14077=>["Value"=>14077,"TextKey"=>"剧情ID4060109","TextValue"=>"Qu’est-ce que tu as dit ?"],
14078=>["Value"=>14078,"TextKey"=>"剧情ID4060110","TextValue"=>"Eh, Enda, je crois que…"],
14079=>["Value"=>14079,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$…"],
14080=>["Value"=>14080,"TextKey"=>"剧情ID4060112","TextValue"=>"Amorgen ! Tiens bon ! Il faut que je parle à quelqu’un d’autre qui pourrait t’aider."],
14081=>["Value"=>14081,"TextKey"=>"剧情ID4060113","TextValue"=>"Tlachtga, est-ce que tu as déjà vu ça auparavant ?"],
14082=>["Value"=>14082,"TextKey"=>"剧情ID4060114","TextValue"=>"Euh…"],
14083=>["Value"=>14083,"TextKey"=>"剧情ID4060115","TextValue"=>"La communication spirituelle n’est pas mon fort. Mais c’est déjà arrivé à ma mère. Le problème devrait encore être l’autel."],
14084=>["Value"=>14084,"TextKey"=>"剧情ID4060116","TextValue"=>"Le pouvoir de l’autel est encore trop faible. Il manque l’élément le plus important."],
14085=>["Value"=>14085,"TextKey"=>"剧情ID4060117","TextValue"=>"Le pouvoir de la déesse @#$>:%^ essence"],
14086=>["Value"=>14086,"TextKey"=>"剧情ID4060118","TextValue"=>"Chef, je crois que j’ai compris. Regardez l’emplacement vide au dessus de la colonne de l’autel !"],
14087=>["Value"=>14087,"TextKey"=>"剧情ID4060119","TextValue"=>"Nous avons besoin de le remplir d’Essence de l’esprit pour augmenter la puissance de l’autel. Est-ce que nous en avons ?"],
14088=>["Value"=>14088,"TextKey"=>"剧情ID4060120","TextValue"=>"Qu’est-ce que tu dis ? Arlan, je t’en passe tout de suite."],
14089=>["Value"=>14089,"TextKey"=>"剧情ID4060121","TextValue"=>"Je m’en occupe !"],
14090=>["Value"=>14090,"TextKey"=>"剧情ID4070101","TextValue"=>"Amorgen, dis quelque chose !"],
14091=>["Value"=>14091,"TextKey"=>"剧情ID4070102","TextValue"=>"Vous devez venir me chercher…"],
14092=>["Value"=>14092,"TextKey"=>"剧情ID4070103","TextValue"=>"Ça devrait aller maintenant. Ta voix n’est plus aussi horrible que celle de Meg lorsqu’elle fait semblant de tousser."],
14093=>["Value"=>14093,"TextKey"=>"剧情ID4070104","TextValue"=>"Meg est juste une vieille femme."],
14094=>["Value"=>14094,"TextKey"=>"剧情ID4070105","TextValue"=>"Vous disiez..."],
14095=>["Value"=>14095,"TextKey"=>"剧情ID4070106","TextValue"=>"J’ai atteint le volcan, mais je n’ai aucun souvenir de ce qu’il s’est passé après. Lorsque je me suis réveillé, j’étais déjà là, dans cet espèce de trou à rats."],
14096=>["Value"=>14096,"TextKey"=>"剧情ID4070107","TextValue"=>"Ton autel est parvenu à me contacter, mais j’imagine qu’il n’a pas pu te guider jusqu’à moi..."],
14097=>["Value"=>14097,"TextKey"=>"剧情ID4070108","TextValue"=>"Car même si je peux ressentir Enda et lui répondre, cet endroit… ne le fera pas, et trouvera le moyen de se cacher."],
14098=>["Value"=>14098,"TextKey"=>"剧情ID4070109","TextValue"=>"Une idée ?"],
14099=>["Value"=>14099,"TextKey"=>"剧情ID4070110","TextValue"=>"Co-exister avec l’environnement… à l’infini… et former une circulation."],
14100=>["Value"=>14100,"TextKey"=>"剧情ID4070111","TextValue"=>"Où est-ce que tu veux en venir ? Utiliser les flammes de cet endroit pour faire fondre ta cellule de glace ?"],
14101=>["Value"=>14101,"TextKey"=>"剧情ID4070112","TextValue"=>"Espèce d’élève grassouillet ! Bien sûr que non."],
14102=>["Value"=>14102,"TextKey"=>"剧情ID4070113","TextValue"=>"Faire circuler… Diffuser la lave pour créer des cendres, laisser les cendres monter et se solidifier en rocher, puis laisser les rochers entrer en éruption à nouveau."],
14103=>["Value"=>14103,"TextKey"=>"剧情ID4070114","TextValue"=>"En fait, tu es un très bon élève."],
14104=>["Value"=>14104,"TextKey"=>"剧情ID4070115","TextValue"=>"Attendez !"],
14105=>["Value"=>14105,"TextKey"=>"剧情ID4080101","TextValue"=>"Est-ce que c’est une… tête de cochon ?"],
14106=>["Value"=>14106,"TextKey"=>"剧情ID4080102","TextValue"=>"Hum-hum."],
14107=>["Value"=>14107,"TextKey"=>"剧情ID4080103","TextValue"=>"Avec tout mon respect, pourquoi est-ce que ça a la forme d’une tête de cochon ?"],
14108=>["Value"=>14108,"TextKey"=>"剧情ID4080104","TextValue"=>"Attends, tu ne devrais pas poser cette question."],
14109=>["Value"=>14109,"TextKey"=>"剧情ID4080105","TextValue"=>"Déesse ! Nous avons besoin de nos compagnons les plus chers pour réussir. Pourquoi ne laisserions nous pas notre partenaire, machin-stan, ici !"],
14110=>["Value"=>14110,"TextKey"=>"剧情ID4080106","TextValue"=>"Regardez comme notre prêtre est adorable ! Quelle subtilité, quelle gentillesse. "],
14111=>["Value"=>14111,"TextKey"=>"剧情ID4080107","TextValue"=>"Toi !"],
14112=>["Value"=>14112,"TextKey"=>"剧情ID4080108","TextValue"=>"Hors de mon chemin, le Chef et moi sommes sur le point démarrer l’Autel."],
14113=>["Value"=>14113,"TextKey"=>"剧情ID4090101","TextValue"=>"D’accord... Enda, en piste."],
14114=>["Value"=>14114,"TextKey"=>"剧情ID4090102","TextValue"=>"Amergon est…"],
14115=>["Value"=>14115,"TextKey"=>"剧情ID4090103","TextValue"=>"En Extrême-orient… Dans un endroit froid et interdit."],
14116=>["Value"=>14116,"TextKey"=>"剧情ID4090104","TextValue"=>"Il a beau faire chaud bouillant ici, je pense que nous devrions préparer nos vêtements d’hiver."],
14117=>["Value"=>14117,"TextKey"=>"剧情ID99990101","TextValue"=>"That fog looks more suspicious than any crisis I have resolved since the establishment of the Royal Kingdom ever."],
14118=>["Value"=>14118,"TextKey"=>"剧情ID99990102","TextValue"=>"And it seems we are kind of stuck here. Hmmm, anybody here?"],
14119=>["Value"=>14119,"TextKey"=>"剧情ID99990103","TextValue"=>"Not a soul? Guess we have to figure out how to clear the fog all by ourselves."],
14120=>["Value"=>14120,"TextKey"=>"剧情ID47990201","TextValue"=>"Hey! Well done! The wheat appeared for a reason! "],
14121=>["Value"=>14121,"TextKey"=>"剧情ID99990202","TextValue"=>"Let's harvest some first and then see what can we do with them!"],
14122=>["Value"=>14122,"TextKey"=>"剧情ID99990301","TextValue"=>"Oh! A little spellbook! It appeared all of a sudden after I had the bread."],
14123=>["Value"=>14123,"TextKey"=>"剧情ID99990302","TextValue"=>"The fog seems thinned a bit because of the spellbook… Maybe we can use the spellbook to clear the fog away."],
14124=>["Value"=>14124,"TextKey"=>"剧情ID34990101","TextValue"=>"Great! Now let's make a plan: merge ingredients, cook foods, get spellbooks, and last but most importantly -- clear fog!"],
14125=>["Value"=>14125,"TextKey"=>"剧情ID99990601","TextValue"=>"Ha! What's that? Looks like there is a chest buried under those broken stones."],
14126=>["Value"=>14126,"TextKey"=>"剧情ID99990602","TextValue"=>"Let's open it at once and see what's inside! I can't wait to tell my friends about all this!"],
14127=>["Value"=>14127,"TextKey"=>"剧情ID99990701","TextValue"=>"It seems we have to stay here for a little while. We should make use of these stones and build a shelter."],
14128=>["Value"=>14128,"TextKey"=>"剧情ID99990702","TextValue"=>"We did it! Indeed, whatever magic in that spellbook certainly worked!"],
14129=>["Value"=>14129,"TextKey"=>"剧情ID99991001","TextValue"=>"I'm curious about what's gonna happen if we merge 5 items of the same kind at once."],
14130=>["Value"=>14130,"TextKey"=>"剧情ID99991002","TextValue"=>"I think we should give it a go. It seems like something wonderful might follow…"],
14131=>["Value"=>14131,"TextKey"=>"剧情ID99990801","TextValue"=>"What's this?"],
14132=>["Value"=>14132,"TextKey"=>"剧情ID99990802","TextValue"=>"It looks like nothing but ruins. But in a very short time, I promise my brother and I can build a perfect base for a stone castle! "],
14133=>["Value"=>14133,"TextKey"=>"剧情ID99990803","TextValue"=>"Right on! The most urgent affair should be constructing a solid castle to shield us against unknown challenges."],
14134=>["Value"=>14134,"TextKey"=>"剧情ID99990501","TextValue"=>"This hat is beaming faint magic."],
14135=>["Value"=>14135,"TextKey"=>"剧情ID99990502","TextValue"=>"Keep merging! I think this might be a clue that leads us to the right man to help us!"],
14136=>["Value"=>14136,"TextKey"=>"剧情ID99990901","TextValue"=>"What is this magical base with four slots on top? Looks like we need something to activate it!"],
14137=>["Value"=>14137,"TextKey"=>"剧情ID99990902","TextValue"=>"Your Majesty, this is a base for a castle. As long as we build the corresponding houses and place them on top of it, we can easily construct our Royal Castle."],
14138=>["Value"=>14138,"TextKey"=>"剧情ID99990903","TextValue"=>"We will remind you to place those houses on top after we finished construction."],
14139=>["Value"=>14139,"TextKey"=>"剧情ID99991101","TextValue"=>"I can't wait to find out what kind of mysterious treasure is hidden inside."],
14140=>["Value"=>14140,"TextKey"=>"剧情ID99991102","TextValue"=>"We can use it to to merge with stone  resources. Then we can have unlimited stones!"],
14141=>["Value"=>14141,"TextKey"=>"剧情ID99991201","TextValue"=>"Very helpful magic crystal! It can be played as anything you want!"],
14142=>["Value"=>14142,"TextKey"=>"剧情ID99991202","TextValue"=>"With it, you only need 2, not 3, of the same item to merge! Try using it!"],
14143=>["Value"=>14143,"TextKey"=>"剧情ID99991203","TextValue"=>"Remember the Magic Crystal can substitute any item you need in game!"],
14144=>["Value"=>14144,"TextKey"=>"剧情ID30400301","TextValue"=>"Look at this little cute stone frame!"],
14145=>["Value"=>14145,"TextKey"=>"剧情ID30400302","TextValue"=>"Compared to my finest architecture, this is far from close. Come on, Watt! We need more stone bricks!"],
14146=>["Value"=>14146,"TextKey"=>"剧情ID30400401","TextValue"=>"Not bad! You built a door with stones."],
14147=>["Value"=>14147,"TextKey"=>"剧情ID30400402","TextValue"=>"Thanks for your kind words. Please give us more time, we can surely build something better!"],
14148=>["Value"=>14148,"TextKey"=>"剧情ID30400501","TextValue"=>"You guys are indeed excellent stonecutter!"],
14149=>["Value"=>14149,"TextKey"=>"剧情ID30400601","TextValue"=>"Wally and I have constructed a much bigger stone house. I have to say that the arduous efforts we had made totally paid back."],
14150=>["Value"=>14150,"TextKey"=>"剧情ID30400602","TextValue"=>"You sure did! Now, I need a high tower to watch the remote lands."],
14151=>["Value"=>14151,"TextKey"=>"剧情ID30400701","TextValue"=>"With only four more houses like this, I can finally have a Castle on this land."],
14152=>["Value"=>14152,"TextKey"=>"剧情ID30400801","TextValue"=>"Castle completed! We can see it as a treasure box!"],
14153=>["Value"=>14153,"TextKey"=>"剧情ID30400802","TextValue"=>"That's right! There are so many goodies inside the Castle."],
14154=>["Value"=>14154,"TextKey"=>"剧情ID31610301","TextValue"=>"The power of the magic hat is greatly boosted! We should find its master for they must a mighty warlock!"],
14155=>["Value"=>14155,"TextKey"=>"剧情ID31610401","TextValue"=>"Humpf! A rabbit!"],
14156=>["Value"=>14156,"TextKey"=>"剧情ID31610402","TextValue"=>"Haha. Yup! If you have fresh and juicy carrots, don't forget my name… Oh, that will be Morris."],
14157=>["Value"=>14157,"TextKey"=>"剧情ID31610403","TextValue"=>"Morris, then you are destined to join my army! Speaking of the knowledge of delicacies, I'm second to none in the whole Hill Kingdom."],
14158=>["Value"=>14158,"TextKey"=>"剧情ID30410301","TextValue"=>"There are logs. We can build a much more comfortable house."],
14159=>["Value"=>14159,"TextKey"=>"剧情ID30410302","TextValue"=>"Cool. Take it slow this time. There is still time till the cold season creeps."],
14160=>["Value"=>14160,"TextKey"=>"剧情ID30410401","TextValue"=>"A decent ceiling at last."],
14161=>["Value"=>14161,"TextKey"=>"剧情ID30410402","TextValue"=>"Keep going! My fireplace is missing a chimney."],
14162=>["Value"=>14162,"TextKey"=>"剧情ID30410501","TextValue"=>"Why don't we build a lovely attic to reserve all my yummy carrots? They are the best foods in winter."],
14163=>["Value"=>14163,"TextKey"=>"剧情ID30410502","TextValue"=>"Haha, aren't carrots the best foods in all four seasons to you, Morris?"],
14164=>["Value"=>14164,"TextKey"=>"剧情ID30410601","TextValue"=>"I think I can use some more space to equip my little magic widgets."],
14165=>["Value"=>14165,"TextKey"=>"剧情ID30410602","TextValue"=>"The frame structure I designed is perfect for a bigger house."],
14166=>["Value"=>14166,"TextKey"=>"剧情ID30410701","TextValue"=>"What a beautiful house! Watt and Wally, I didn't expect your woodwork skills to be equally excellent!"],
14167=>["Value"=>14167,"TextKey"=>"剧情ID30410801","TextValue"=>"I can't believe one can actually build an outstanding architecture with zero magic spell cast."],
14168=>["Value"=>14168,"TextKey"=>"剧情ID30410802","TextValue"=>"My brother is an expert in architecture design. As for me… I'm good at being a cheerleader."],
14169=>["Value"=>14169,"TextKey"=>"剧情ID30410803","TextValue"=>"Watt, we need to catch up!"],
14170=>["Value"=>14170,"TextKey"=>"剧情ID30410901","TextValue"=>"Behold! A warm and cozy castle is ready!"],
14171=>["Value"=>14171,"TextKey"=>"剧情ID30410902","TextValue"=>"Nice! It is warm in winter and cool in summer! I suggest you prepare some hot biscuits for afternoon tea in winter times."],
14172=>["Value"=>14172,"TextKey"=>"剧情ID30410903","TextValue"=>"Or some carrot cakes and loaves of bread."],
14173=>["Value"=>14173,"TextKey"=>"剧情ID31620301","TextValue"=>"Morris, who would need these many harps?"],
14174=>["Value"=>14174,"TextKey"=>"剧情ID31620302","TextValue"=>"Ummm, I can't think of anyone. But this person must be a musician!"],
14175=>["Value"=>14175,"TextKey"=>"剧情ID31620401","TextValue"=>"I feel the power within these harps continues to grow."],
14176=>["Value"=>14176,"TextKey"=>"剧情ID31620501","TextValue"=>"These harps can be the best sword for a musician. So, can it keep leveling up?"],
14177=>["Value"=>14177,"TextKey"=>"剧情ID31620601","TextValue"=>"I can almost see the grandness of this harp being played in a luxurious music hall of the House of Hill."],
14178=>["Value"=>14178,"TextKey"=>"剧情ID31620602","TextValue"=>"I believe the owner of this harp will be given such a chance."],
14179=>["Value"=>14179,"TextKey"=>"剧情ID31620701","TextValue"=>"I'm Ramble, your humble servant. I have one more thing to celebrate in songs!"],
14180=>["Value"=>14180,"TextKey"=>"剧情ID31620702","TextValue"=>"Umm, can someone please make me an Icecream Muffin? I'm sure your beautiful music will be a perfect combo to it, which is even better than cinnamon powder!"],
14181=>["Value"=>14181,"TextKey"=>"剧情ID31620703","TextValue"=>"*In the arc music hall, in the breezy spring fields, in the presence of the one, whom the hymn gives*"],
14182=>["Value"=>14182,"TextKey"=>"剧情ID30420401","TextValue"=>"I quite like this exquisite door. Well, perhaps a wind vane will be needed over the sea?"],
14183=>["Value"=>14183,"TextKey"=>"剧情ID30420501","TextValue"=>"Ohh, it so reminds me of those old adventure days. Listen, we need to increase the height of the base. Y'all know waves crashing is no kidding."],
14184=>["Value"=>14184,"TextKey"=>"剧情ID30420601","TextValue"=>"Pretty good! Wally, you are no doubt a genius!"],
14185=>["Value"=>14185,"TextKey"=>"剧情ID30420602","TextValue"=>"Haha, Wally never fails you! And... since I've known him for my life, it's far from the time to celebrate."],
14186=>["Value"=>14186,"TextKey"=>"剧情ID30420701","TextValue"=>"Praise be to the brilliant craftsman! And what else do we need… bright lights dancing in the dark night, becoming the only beacon to the travelers."],
14187=>["Value"=>14187,"TextKey"=>"剧情ID30420801","TextValue"=>"What a wonderful boathouse! With only a couple more like this, our cruise ship will be ready to set sail!"],
14188=>["Value"=>14188,"TextKey"=>"剧情ID30420901","TextValue"=>"I can hear the waves beating and I can smell the storm coming! How exciting!"],
14189=>["Value"=>14189,"TextKey"=>"剧情ID30420902","TextValue"=>"Haha, check out Ramble's dreaming about adventures already! Watt and Wally, you two are indeed the best craftsmen ever!"],
14190=>["Value"=>14190,"TextKey"=>"剧情ID30420903","TextValue"=>"Thanks for your appreciation, Your Majesty! This boat castle also means our strength is greatly enhanced! "],
14191=>["Value"=>14191,"TextKey"=>"剧情ID31630301","TextValue"=>"That drum grew taller, looking like it's for an adult now! I want to jam a little bit, lol!"],
14192=>["Value"=>14192,"TextKey"=>"剧情ID31630401","TextValue"=>"In my opinion, a belt is needed for the drum. That'll be protective to the drumhead."],
14193=>["Value"=>14193,"TextKey"=>"剧情ID31630501","TextValue"=>"How about a fixation on the drum frame? Ramble knows musicians like him will get so carried away during the performance. It'll be a shame if it goes broken."],
14194=>["Value"=>14194,"TextKey"=>"剧情ID31630502","TextValue"=>"Correct. I should count how many harps I've played. One, two, three, four…"],
14195=>["Value"=>14195,"TextKey"=>"剧情ID31630601","TextValue"=>"The feather decoration looks very cute and unique. What do you think, Ramble?"],
14196=>["Value"=>14196,"TextKey"=>"剧情ID31630602","TextValue"=>"Yeah… but it might get in the way while playing. It's better to change the décor's location."],
14197=>["Value"=>14197,"TextKey"=>"剧情ID31630701","TextValue"=>"Now, it won't bother beating the drum. "],
14198=>["Value"=>14198,"TextKey"=>"剧情ID31630702","TextValue"=>"But the original simplicity and delicate beauty are weakened. Ramble, do you think you can improve that?"],
14199=>["Value"=>14199,"TextKey"=>"剧情ID31630801","TextValue"=>"Did you guys find my drum? Thanks!"],
14200=>["Value"=>14200,"TextKey"=>"剧情ID31630802","TextValue"=>"What a lovely wee lass!"],
14201=>["Value"=>14201,"TextKey"=>"剧情ID31630803","TextValue"=>"*Giggles* Thank you. I'm Melody, feel free to call me Mel! I have no idea why I woke up here in the fog."],
14202=>["Value"=>14202,"TextKey"=>"剧情ID31630804","TextValue"=>"That happened to everybody. Mel, glad you are joining us in this adventure!"],
14203=>["Value"=>14203,"TextKey"=>"剧情ID30430301","TextValue"=>"Beautiful pearl! I always want one, even though it doesn't have any function."],
14204=>["Value"=>14204,"TextKey"=>"剧情ID30430302","TextValue"=>"I know you'll like it! Well, Mel, we can build a pearl house next."],
14205=>["Value"=>14205,"TextKey"=>"剧情ID30430401","TextValue"=>"Wally is so creative! Pearl rooftop will be beautiful, but wouldn't that be too fragile?"],
14206=>["Value"=>14206,"TextKey"=>"剧情ID30430501","TextValue"=>"Dearest Watt and Wally, can you build it more spacious? More space is needed to stock pearls and shells."],
14207=>["Value"=>14207,"TextKey"=>"剧情ID30430502","TextValue"=>"One sec."],
14208=>["Value"=>14208,"TextKey"=>"剧情ID30430601","TextValue"=>"How about adding some seaweeds as décor?"],
14209=>["Value"=>14209,"TextKey"=>"剧情ID30430701","TextValue"=>"Stunning! Hahaha, I'm so happy. Can't stop smiling whenever I see the pearl house."],
14210=>["Value"=>14210,"TextKey"=>"剧情ID30430702","TextValue"=>"Aww, Mel, wait a sec. I stole — I mean, borrowed the design sketch from Wally."],
14211=>["Value"=>14211,"TextKey"=>"剧情ID30430801","TextValue"=>"Wow! There are two spires! This landscape is so glorious that I haven't seen it even in my most unstrained dream!"],
14212=>["Value"=>14212,"TextKey"=>"剧情ID30430802","TextValue"=>"It only takes four mansions like this to build a top-notch castle."],
14213=>["Value"=>14213,"TextKey"=>"剧情ID30430901","TextValue"=>"What do you think? Not bad, right? I knew Mel would love those spires."],
14214=>["Value"=>14214,"TextKey"=>"剧情ID30430902","TextValue"=>"Can I look around? Alrighty! I'm coming in! Aha, where's my drum? I want to drop some beats."],
14215=>["Value"=>14215,"TextKey"=>"剧情ID30430903","TextValue"=>"Let me be your accompany, Mel."],
14216=>["Value"=>14216,"TextKey"=>"剧情ID31640301","TextValue"=>"This crown should belong to someone important. Your Majesty, does that ring any bells?"],
14217=>["Value"=>14217,"TextKey"=>"剧情ID31640302","TextValue"=>"I'm not sure. It doesn't have the Royal Lable of House Hill. So, I really can't think of anyone who it belongs."],
14218=>["Value"=>14218,"TextKey"=>"剧情ID31640401","TextValue"=>"Magnificent gold, workmanship glowed. Used as a symbol in poems, represent power the most."],
14219=>["Value"=>14219,"TextKey"=>"剧情ID31640501","TextValue"=>"Inlaid with emerald, ha, very much in line with my Queen's aesthetic!"],
14220=>["Value"=>14220,"TextKey"=>"剧情ID31640601","TextValue"=>"What? Morris just told me such a luxurious crown is not even superior!"],
14221=>["Value"=>14221,"TextKey"=>"剧情ID31640602","TextValue"=>"Yup. I can feel the magic power hidden in the crown is far from the upper limit."],
14222=>["Value"=>14222,"TextKey"=>"剧情ID31640701","TextValue"=>"When the crown's owner came, I wonder if I could borrow to try it on? It is sooooo pretty!"],
14223=>["Value"=>14223,"TextKey"=>"剧情ID31640801","TextValue"=>"My! I can feel the magic is vibrating intensely. Its owner will soon arrive!"],
14224=>["Value"=>14224,"TextKey"=>"剧情ID31640901","TextValue"=>"Oh my goodness! Hill, my old pal!"],
14225=>["Value"=>14225,"TextKey"=>"剧情ID31640902","TextValue"=>"No way! I can't believe you are stuck here too! Oi oi, everyone! Let me introduce the King of Lion, Simba."],
14226=>["Value"=>14226,"TextKey"=>"剧情ID31640903","TextValue"=>"I have made a preliminary judgment about the surroundings here. There's no time to delay. Keep constructing and expanding territory."],
14227=>["Value"=>14227,"TextKey"=>"剧情ID30440301","TextValue"=>"This shabby wagon can barely shelter me from the wind and rain."],
14228=>["Value"=>14228,"TextKey"=>"剧情ID30440302","TextValue"=>"Lion King, you are right. We still need more time."],
14229=>["Value"=>14229,"TextKey"=>"剧情ID30440401","TextValue"=>"It is basic. However, that's a great model for further processing."],
14230=>["Value"=>14230,"TextKey"=>"剧情ID30440402","TextValue"=>"Improve the driver's seat. The long journey shall not be easy."],
14231=>["Value"=>14231,"TextKey"=>"剧情ID30440501","TextValue"=>"Nice! Guest seats also need to be improved. Watt and Wally, can you two please do us one more favor?"],
14232=>["Value"=>14232,"TextKey"=>"剧情ID30440601","TextValue"=>"Woohoo! Comfort level considerably increased. Well, I say we build it more confined. Privacy is no lesser than safety. Simba, I only suggested it because of our cooperation last time."],
14233=>["Value"=>14233,"TextKey"=>"剧情ID30440701","TextValue"=>"Indeed excellent! I've heard about your craftmanship, Watt and Wally. Too bad my lions only have fluffy paws, and this kind of delicate work is no match for lions."],
14234=>["Value"=>14234,"TextKey"=>"剧情ID30440702","TextValue"=>"Lol! Thanks for your appreciation, Lion King! There's still room for improvement. Wait and see what happens!"],
14235=>["Value"=>14235,"TextKey"=>"剧情ID30440801","TextValue"=>"Wally, can you add another story to it? The magic circulation requires height."],
14236=>["Value"=>14236,"TextKey"=>"剧情ID30440802","TextValue"=>"Gotcha! High-ceiling design is my expertise."],
14237=>["Value"=>14237,"TextKey"=>"剧情ID30440901","TextValue"=>"Watt and Wally, do you want to follow me to my Kingdom after all this? I guarantee that you will be treated even better than in Kingdom Hill."],
14238=>["Value"=>14238,"TextKey"=>"剧情ID30440902","TextValue"=>"Simba, I'm right here! I thought you would at least avoid me while poaching my staff!"],
14239=>["Value"=>14239,"TextKey"=>"剧情ID30441001","TextValue"=>"This castle means a lot to me. It allows me to live the spontaneous life I love and takes me to wherever I want."],
14240=>["Value"=>14240,"TextKey"=>"剧情ID30441002","TextValue"=>"Simba has been running freely over the fields. No wonder he wants a mobile castle to live in."],
14241=>["Value"=>14241,"TextKey"=>"剧情ID30441003","TextValue"=>"Watt and Wally, please take serious consideration into the advice I gave earlier."],
14242=>["Value"=>14242,"TextKey"=>"剧情ID31650301","TextValue"=>"Wow! It's getting better! But the portion for me is still too small."],
14243=>["Value"=>14243,"TextKey"=>"剧情ID31650401","TextValue"=>"The magic around the foods and the table are filling up. "],
14244=>["Value"=>14244,"TextKey"=>"剧情ID31650501","TextValue"=>"I'm a carnivore. But I know Hill's a sweet tooth. If you stay out of mine, I'll stay out of yours."],
14245=>["Value"=>14245,"TextKey"=>"剧情ID31650601","TextValue"=>"This reminds me of the old times when I host banquets. Though we are a little short of number, we can surely prepare a big meal for dinner tonight!"],
14246=>["Value"=>14246,"TextKey"=>"剧情ID31650701","TextValue"=>"This symbolized a fairy evening."],
14247=>["Value"=>14247,"TextKey"=>"剧情ID31650801","TextValue"=>"The magic is reaching the pinnacle. We can soon meet the owner of these yummy visions. "],
14248=>["Value"=>14248,"TextKey"=>"剧情ID31650901","TextValue"=>"…"],
14249=>["Value"=>14249,"TextKey"=>"剧情ID31650902","TextValue"=>"Hiya, lovely girl! What's your name?"],
14250=>["Value"=>14250,"TextKey"=>"剧情ID31650903","TextValue"=>"I… ummmm... I don't have a name. They call me "Little Match Girl". Perhaps… maybe... you can call me "Match"?"],
14251=>["Value"=>14251,"TextKey"=>"剧情ID31650904","TextValue"=>"Okay. Don't be afraid, kid. Come in and warm yourself up in our castle."],
14252=>["Value"=>14252,"TextKey"=>"剧情ID30450301","TextValue"=>"What's up, Match. Is this matchbox something you are thinking of?"],
14253=>["Value"=>14253,"TextKey"=>"剧情ID30450302","TextValue"=>"Yes, yes! If I curl up, I can squeeze myself in it, protecting myself against the wind."],
14254=>["Value"=>14254,"TextKey"=>"剧情ID30450401","TextValue"=>"Thank you, Watt! I can't imagine I can own a hut with beams one day. So happy!"],
14255=>["Value"=>14255,"TextKey"=>"剧情ID30450501","TextValue"=>"I can actually stand up inside the house. No more curling up. Hooray!"],
14256=>["Value"=>14256,"TextKey"=>"剧情ID30450601","TextValue"=>"Match, I think you'll like this windproof curtain."],
14257=>["Value"=>14257,"TextKey"=>"剧情ID30450602","TextValue"=>"Totally! I can save some matches to warm up now."],
14258=>["Value"=>14258,"TextKey"=>"剧情ID30450701","TextValue"=>"Ta-da~ The high-ceiling design I'm best at!"],
14259=>["Value"=>14259,"TextKey"=>"剧情ID30450702","TextValue"=>"Thank you so much! This is the prettiest house I've ever seen in my life… even better than those rich people's houses on the streets in the past."],
14260=>["Value"=>14260,"TextKey"=>"剧情ID30450801","TextValue"=>"If you can come up with one request for the house, what would it be?"],
14261=>["Value"=>14261,"TextKey"=>"剧情ID30450802","TextValue"=>"Ahhh… Owning a house is already beyond my expectation. I don't have any requests."],
14262=>["Value"=>14262,"TextKey"=>"剧情ID30450803","TextValue"=>"Not with that attitude, Match! C'mon, think harder! What do you really really really want?"],
14263=>["Value"=>14263,"TextKey"=>"剧情ID30450804","TextValue"=>"Umm… I think… that will be warmth. Yeah! I want it to be super warm!"],
14264=>["Value"=>14264,"TextKey"=>"剧情ID30450901","TextValue"=>"As long as we build four mansions like this, Little Match Girl will have her private castle!"],
14265=>["Value"=>14265,"TextKey"=>"剧情ID30451001","TextValue"=>"Are you guys serious? … This beautiful castle… is MINE?"],
14266=>["Value"=>14266,"TextKey"=>"剧情ID30451002","TextValue"=>"Of course, my dear child! This land is full of dangers. That's why we should value our accommodations. "],
14267=>["Value"=>14267,"TextKey"=>"剧情ID30451003","TextValue"=>"Waaah… Thank you! Thank you all!"],
14268=>["Value"=>14268,"TextKey"=>"剧情ID30451004","TextValue"=>"Go take some proper rest and be ready for the upcoming challenges!"],
14269=>["Value"=>14269,"TextKey"=>"剧情ID31660301","TextValue"=>"Fixation was a great idea. However, can we change its frame to a modern design? It looks not so transparent now."],
14270=>["Value"=>14270,"TextKey"=>"剧情ID31660401","TextValue"=>"Who will be the lamp holder?"],
14271=>["Value"=>14271,"TextKey"=>"剧情ID31660501","TextValue"=>"The fire is getting so much more bright! Morris, do you agree?"],
14272=>["Value"=>14272,"TextKey"=>"剧情ID31660502","TextValue"=>"Indeed, Your Majesty. This is a sign of enhanced magic."],
14273=>["Value"=>14273,"TextKey"=>"剧情ID31660601","TextValue"=>"Is this… a pumpkin? *Sweet'o'pumpkin, spooky'o'night* It's a perfect plant for my serenade!"],
14274=>["Value"=>14274,"TextKey"=>"剧情ID31660701","TextValue"=>"A lovely pumpkin lamp. It can be used as a decorative ornament."],
14275=>["Value"=>14275,"TextKey"=>"剧情ID31660702","TextValue"=>"It's hard to tell that the magic power it possessed is quite remarkable."],
14276=>["Value"=>14276,"TextKey"=>"剧情ID31660801","TextValue"=>"Did you guys notice that the impression of the pumpkin lamp just changed! It looks more and more like a human… Spooky..."],
14277=>["Value"=>14277,"TextKey"=>"剧情ID31660802","TextValue"=>"I have a hunch that this pumpkin friend will be meeting us soon."],
14278=>["Value"=>14278,"TextKey"=>"剧情ID31660901","TextValue"=>"Greetings, y'all! Ready for the spooky party at midnight?"],
14279=>["Value"=>14279,"TextKey"=>"剧情ID31660902","TextValue"=>"Pumpkinhead! Don't scare young kids. By the way, is your head ripe and sweet when you pick it?"],
14280=>["Value"=>14280,"TextKey"=>"剧情ID31660903","TextValue"=>"Ummm… actually pumpkins are not edible for they contain a toxic chemical called "pumpkin acid". And don't call me pumpkinhead, my name is Jack!"],
14281=>["Value"=>14281,"TextKey"=>"剧情ID31660904","TextValue"=>"Alright, Jack. That is a lie. Are you afraid I'm going to eat you?"],
14282=>["Value"=>14282,"TextKey"=>"剧情ID31660905","TextValue"=>"… See you, Mr. King!"],
14283=>["Value"=>14283,"TextKey"=>"剧情ID30460301","TextValue"=>"For me, straws are the best protection against cold."],
14284=>["Value"=>14284,"TextKey"=>"剧情ID30460401","TextValue"=>"Help me think… what are the things people might be startled at first glance? Oh right! Skeleton! I want to put a skeleton set on my front gate. "],
14285=>["Value"=>14285,"TextKey"=>"剧情ID30460501","TextValue"=>"Why don't you add something pumpkins to your façade? Just like what I did to mine with carrots."],
14286=>["Value"=>14286,"TextKey"=>"剧情ID30460601","TextValue"=>"Do you want to open a skylight, Mr. Jack? To do that, we have to take off the skeleton décor."],
14287=>["Value"=>14287,"TextKey"=>"剧情ID30460701","TextValue"=>"I really like it! But I feel that pumpkin can be bigger. Can you help me out?"],
14288=>["Value"=>14288,"TextKey"=>"剧情ID30460702","TextValue"=>"Sure thing. You can always trust Watt with carving."],
14289=>["Value"=>14289,"TextKey"=>"剧情ID30460801","TextValue"=>"Wow, soooooo beautiful! Hem hem, no, I mean… I still need a lantern on it! Yup, a lantern!"],
14290=>["Value"=>14290,"TextKey"=>"剧情ID30460901","TextValue"=>"This mansion looks like a large Jack! Hah-hah-hah, a small Jack living in a big Jack!"],
14291=>["Value"=>14291,"TextKey"=>"剧情ID30461001","TextValue"=>"Wow, my pumpkin, my straws, my lantern! Watt and Wally, you two are simply geniuses! I announce that you two are officially on top of my PRANKING LIST!"],
14292=>["Value"=>14292,"TextKey"=>"剧情ID30461002","TextValue"=>"Oh geez, cut me some slacks. But please do not let Watt escape!"],
